INSERT INTO `text` VALUES ('145', '98950', '109490', '对于每日灵粮的话，上下两片面包就分别代表着灵修开始前安静心灵的祷告和灵秀结束后感恩回应的祷告。', '11', '0', '31', '2019-03-17 20:00:38', 'E:/2.lfasr/update.json');
