INSERT INTO `text` VALUES ('155', '133930', '138700', '可以理解为我们的唱诗，赞美我们感性上与神的相交。', '15', '0', '17', '2019-03-17 20:00:42', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('156', '139130', '146000', '如果再丰富一些配乐伴奏节拍和宣告的话，就相当于加了沙拉酱和其他的配料。', '15', '0', '22', '2019-03-17 20:00:43', 'E:/2.lfasr/update.json');
