INSERT INTO `text` VALUES ('236', '93210', '95930', '中间一个外交理论的鸡块，', '11', '0', '7', '2019-03-17 20:04:38', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('237', '95940', '98650', '上面还有几片新新的蔬菜和沙拉。', '11', '0', '11', '2019-03-17 20:04:38', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('238', '98950', '109490', '对于每日灵粮的话，上下两片面包就分别代表着灵修开始前安静心灵的祷告和灵秀结束后感恩回应的祷告。', '11', '0', '31', '2019-03-17 20:04:39', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('239', '109650', '114260', '中间的主角肌肉块可以理解为圣经上神的话语，', '11', '0', '14', '2019-03-17 20:04:40', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('240', '114280', '118530', '读经相当于咬下鸡肉块外面焦脆的壳，', '11', '0', '14', '2019-03-17 20:04:40', 'E:/2.lfasr/update.json');
