INSERT INTO `text` VALUES ('246', '129370', '131260', '鲜嫩多汁的鸡肉，', '15', '0', '6', '2019-03-17 20:04:43', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('247', '131510', '133870', '几片新鲜的蔬菜和西红柿，', '15', '0', '8', '2019-03-17 20:04:43', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('248', '133930', '138700', '可以理解为我们的唱诗，赞美我们感性上与神的相交。', '15', '0', '17', '2019-03-17 20:04:44', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('249', '139130', '146000', '如果再丰富一些配乐伴奏节拍和宣告的话，就相当于加了沙拉酱和其他的配料。', '15', '0', '22', '2019-03-17 20:04:44', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('250', '146140', '150970', '这样的话，一个完整的味道鲜美营养均衡的属灵汉堡早餐', '15', '0', '16', '2019-03-17 20:04:45', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('251', '150990', '152100', '就成了。', '15', '0', '4', '2019-03-17 20:04:46', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('252', '152840', '155130', '有人说这样吃热比较干！', '16', '0', '9', '2019-03-17 20:04:46', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('253', '155140', '157460', '要是再来一杯牛奶就好了，', '17', '0', '10', '2019-03-17 20:04:47', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('254', '157540', '159640', '那可以代表着圣灵的浇灌。', '17', '0', '8', '2019-03-17 20:04:47', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('255', '159660', '164630', '有了圣灵的参与属灵，早餐就更加容易下咽舒畅。', '17', '0', '14', '2019-03-17 20:04:47', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('256', '164650', '168730', '当然只要我们愿意，我们还可以加入更多美好的事物进来。', '17', '0', '16', '2019-03-17 20:04:48', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('257', '169400', '171270', '这里需要特别说一下，', '18', '0', '6', '2019-03-17 20:04:49', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('258', '171280', '172550', '祷告是我们。', '18', '0', '5', '2019-03-17 20:04:49', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('259', '172560', '174150', '向主在说话，', '19', '0', '5', '2019-03-17 20:04:49', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('260', '174160', '177090', '读音是我们的主向我们说话。', '19', '0', '9', '2019-03-17 20:04:50', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('261', '177100', '182840', '严谨和没想就是我们想办法把神的话放在我们的心里面，', '19', '0', '18', '2019-03-17 20:04:50', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('262', '182860', '186620', '尝试和赞美是我们在感性上与身的交通，', '19', '0', '13', '2019-03-17 20:04:51', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('263', '186640', '187150', '每一个。', '19', '0', '4', '2019-03-17 20:04:51', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('264', '187160', '188970', '部分都是非常重要的。', '20', '0', '6', '2019-03-17 20:04:51', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('265', '189180', '190420', '我们如果单单。', '20', '0', '5', '2019-03-17 20:04:52', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('266', '190430', '196890', '重视集中到某一个方面，或者忽略了任何一个方面，都会造成我们属灵的营养不良。', '21', '0', '23', '2019-03-17 20:04:52', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('267', '197400', '199960', '连续的核心部分是圣经的经文。', '21', '0', '9', '2019-03-17 20:04:53', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('268', '199980', '203590', '在图片的最上面推荐了有12卷书，', '21', '0', '12', '2019-03-17 20:04:54', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('269', '203820', '206010', '从左到右分别是。', '21', '0', '8', '2019-03-17 20:04:54', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('270', '206210', '208240', '约翰福音罗马书，', '22', '0', '4', '2019-03-17 20:04:55', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('271', '208260', '211850', '有所书约翰123，舒雅各书。', '22', '0', '10', '2019-03-17 20:04:55', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('272', '211910', '216570', '马太福音使徒行传，创世纪，出埃及记和诗篇。', '22', '0', '13', '2019-03-17 20:04:55', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('273', '216580', '221590', '这都是比较容易读的，经文，涵盖的内容也相对全面一些。', '22', '0', '17', '2019-03-17 20:04:56', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('274', '222190', '226530', '每次灵修的时候经文比较多，每天读十节左右就可以了。', '22', '0', '17', '2019-03-17 20:04:56', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('275', '226540', '227790', '多读几遍。', '22', '0', '5', '2019-03-17 20:04:57', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('276', '227900', '231220', '这样的话20分钟的时间是够用的。', '22', '0', '11', '2019-03-17 20:04:57', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('277', '231980', '236100', '这个方式比较适合于还没有稳固零有习惯的地方姐妹。', '22', '0', '15', '2019-03-17 20:04:58', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('278', '236120', '239620', '如果你已经有了比较稳固的领show，并且也比较满意，', '22', '0', '15', '2019-03-17 20:04:59', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('279', '239640', '242190', '那么就可以在你现有的基础上', '22', '0', '9', '2019-03-17 20:04:59', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('280', '242210', '247130', '调整一下结构式祷告，经文和诗歌的比例均衡一些，', '22', '0', '14', '2019-03-17 20:05:00', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('281', '247150', '251960', '使我们的灵里面的供应不至于出现营养的缺失就可以了。', '22', '0', '16', '2019-03-17 20:05:00', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('282', '252230', '254400', '再一个就是时间的问题，', '22', '0', '7', '2019-03-17 20:05:01', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('283', '254430', '260620', '如果能把零星的时间放在早上是最好的，实在不行可以考虑放在其他的时间。', '22', '0', '21', '2019-03-17 20:05:01', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('284', '260890', '264360', '每天尽量是固定的时间固定的地方。', '22', '0', '10', '2019-03-17 20:05:02', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('285', '264370', '267370', '预备好圣经，诗歌本笔记本。', '22', '0', '8', '2019-03-17 20:05:03', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('286', '267690', '272690', '如果不行，也可以考虑用一些零散的时间，比如陆上交通的时间，', '22', '0', '18', '2019-03-17 20:05:03', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('287', '272710', '274100', '等待的时间，', '22', '0', '4', '2019-03-17 20:05:04', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('288', '274370', '277160', '总而言之有比没有要好，', '22', '0', '6', '2019-03-17 20:05:04', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('289', '277170', '279940', '有固定的时间比零散的时间要好，', '22', '0', '11', '2019-03-17 20:05:04', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('290', '279950', '283130', '放在早上比放在其他的时间要好。', '22', '0', '10', '2019-03-17 20:05:05', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('291', '283780', '285040', '刚开始的时候，', '23', '0', '5', '2019-03-17 20:05:05', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('292', '285050', '289290', '或许也会有失败，但是请不要灰心，一定要鼓起勇气。', '23', '0', '17', '2019-03-17 20:05:05', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('293', '289310', '295820', '哪一天失败了，就从那一天重新开始做起来，务必尽早培养天天灵修的好习惯。', '23', '0', '25', '2019-03-17 20:05:06', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('294', '296040', '300980', '最后，愿主耶稣基督，还有我们的父神赐福于大家，', '23', '0', '16', '2019-03-17 20:05:07', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('295', '300990', '305070', '使我们都能够称为生命丰盛，能靠着圣灵的帮助，', '23', '0', '16', '2019-03-17 20:05:08', 'E:/2.lfasr/update.json');
INSERT INTO `text` VALUES ('296', '305070', '307170', '或出影响力的基督的门徒。', '24', '0', '8', '2019-03-17 20:05:10', 'E:/2.lfasr/update.json');
