INSERT INTO `text` VALUES ('627', '159660', '164630', '有了圣灵的参与属灵，早餐就更加容易下咽舒畅。', '17', '0', '14', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('628', '164650', '168730', '当然只要我们愿意，我们还可以加入更多美好的事物进来。', '17', '0', '16', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('629', '169400', '171270', '这里需要特别说一下，', '18', '0', '6', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('630', '171280', '172550', '祷告是我们。', '18', '0', '5', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('631', '172560', '174150', '向主在说话，', '19', '0', '5', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('632', '174160', '177090', '读音是我们的主向我们说话。', '19', '0', '9', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('633', '177100', '182840', '严谨和没想就是我们想办法把神的话放在我们的心里面，', '19', '0', '18', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('634', '182860', '186620', '尝试和赞美是我们在感性上与身的交通，', '19', '0', '13', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('635', '186640', '187150', '每一个。', '19', '0', '4', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('636', '187160', '188970', '部分都是非常重要的。', '20', '0', '6', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('637', '189180', '190420', '我们如果单单。', '20', '0', '5', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('638', '190430', '196890', '重视集中到某一个方面，或者忽略了任何一个方面，都会造成我们属灵的营养不良。', '21', '0', '23', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('639', '197400', '199960', '连续的核心部分是圣经的经文。', '21', '0', '9', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('640', '199980', '203590', '在图片的最上面推荐了有12卷书，', '21', '0', '12', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('641', '203820', '206010', '从左到右分别是。', '21', '0', '8', '2019-03-18 16:33:51', '更新的世界.m4a');
