INSERT INTO `text` VALUES ('643', '208260', '211850', '有所书约翰123，舒雅各书。', '22', '0', '10', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('644', '211910', '216570', '马太福音使徒行传，创世纪，出埃及记和诗篇。', '22', '0', '13', '2019-03-18 16:33:51', '更新的世界.m4a');
