INSERT INTO `text` VALUES ('660', '274370', '277160', '总而言之有比没有要好，', '22', '0', '6', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('661', '277170', '279940', '有固定的时间比零散的时间要好，', '22', '0', '11', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('662', '279950', '283130', '放在早上比放在其他的时间要好。', '22', '0', '10', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('663', '283780', '285040', '刚开始的时候，', '23', '0', '5', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('664', '285050', '289290', '或许也会有失败，但是请不要灰心，一定要鼓起勇气。', '23', '0', '17', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('665', '289310', '295820', '哪一天失败了，就从那一天重新开始做起来，务必尽早培养天天灵修的好习惯。', '23', '0', '25', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('666', '296040', '300980', '最后，愿主耶稣基督，还有我们的父神赐福于大家，', '23', '0', '16', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('667', '300990', '305070', '使我们都能够称为生命丰盛，能靠着圣灵的帮助，', '23', '0', '16', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('668', '305070', '307170', '或出影响力的基督的门徒。', '24', '0', '8', '2019-03-18 16:33:51', '更新的世界.m4a');
INSERT INTO `text` VALUES ('669', '34710', '38990', '用姐妹准备平安，我们再次来现场，到到', '0', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('670', '40000', '47550', '现在就着耶稣基督，我们感谢你在清晨的时候用你的爱吸引我们再次来到你的殿中。', '0', '0', '27', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('671', '48170', '51740', '我们愿意带着心灵和诚实来敬拜你！', '1', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('672', '51760', '73080', '求你赐给我们像玛利亚那样有谦卑受教的新作，今天在我们聚会的时候，你的宝座就在我们中间，你的账目也在我们中间，你要问我们每一个人的平安，要擦去我们所有人的眼泪，只要我们盼望在今天的机会当中能够遇见你！', '2', '0', '70', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('673', '73090', '88500', '只有遇见你才是真正的聚会，只有遇见你才是真正的敬拜主，愿意按时分粮给我们每一个人愿意的保险，接近我们众人院里的胜利，在这里自由自在的运行，', '3', '0', '47', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('674', '88500', '92400', '我们这样同心祷告，奉耶稣基督得胜的名求。', '4', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('675', '92410', '93590', '唉。', '4', '0', '3', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('676', '94110', '101770', '想请问我们大家，在这个世界上有没有一些国家和地区是我们大家特别羡慕的？', '5', '0', '21', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('677', '103070', '114370', '如果说到一些国家和地区的话，那首先想到的就是欧美，这些国家是发达的，国家啊是繁荣的地区，很多人都很向往。', '5', '0', '36', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('678', '114390', '115970', '但是随着', '5', '0', '2', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('679', '115990', '123880', '最近一些事情的发生，随着枪击案的频频发生，我们发现欧美也不是天堂。', '5', '0', '20', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('680', '124370', '128470', '那今天我们分享的题目是更新的事件。', '5', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('681', '128710', '133780', '这是耶稣基督为我们最终所预备的圣徒所居住的地方，', '5', '0', '16', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('682', '133790', '138210', '那是真正的美好，就是我们传说中的天堂。', '5', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('683', '139260', '143970', '我们要看的经文是启示录的第21章，', '5', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('684', '147730', '149840', '啊是整章的经文。', '6', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('685', '149860', '155220', '我们弟兄读一节，姊妹读一节，我们先把这章的经文读一下。', '6', '0', '21', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('686', '155230', '159750', '当我们读这章经文的时候，呢我们可以带着喜乐的心，', '6', '0', '18', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('687', '159750', '164120', '因为这一切都是神应许给我们的。', '7', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('688', '164130', '165710', '好，我们弟兄就有些。', '7', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('689', '165720', '166590', '态度！', '8', '0', '3', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('690', '167020', '175650', '我又看见一个新天新地，因为以前的天地已经过去了，海也不再有了！', '9', '0', '23', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('691', '175660', '177370', '我又面临', '10', '0', '3', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('692', '177420', '181590', '新墙有时半天儿，', '10', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('693', '181600', '187920', '将预备好了，就清毒康是整齐等等。', '10', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('694', '187930', '206870', '我听见有大声音从宝座出来说，看哪神的帐幕在人间，他要与人同住，他们要作他的子民，谁要亲自与他们同在，做他们的神，让他们明确。', '11', '0', '50', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('695', '206880', '211450', '不再有死亡，也别再有回来过。', '12', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('696', '211460', '216030', '号没，因为以前的事都过去了。', '12', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('697', '216040', '227010', '坐宝座的说，看，我将一切都更新了，又说你要写上，因这些话是可信的，是真实的！', '13', '0', '33', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('698', '227020', '231070', '他有对我说，构成了我是爸爸。', '14', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('699', '231080', '240290', '我是我是说我是中我要将生命选择一些，明白自己的那个', '14', '0', '19', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('700', '240310', '242050', '得！', '14', '0', '3', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('701', '242060', '249680', '得胜的必承受这些为业，我要做他的神，他要做我的儿子！', '15', '0', '23', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('702', '249740', '267510', '有感谢的性格症的发生的淫乱性，接触的待项和一切说谎话，他们的份对外收着硫磺的红利，这是第二次拿。', '16', '0', '38', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('703', '267520', '279530', '着七个今晚成晚，没后期灾的七位天使中，有一位来对我说，你到我这里来，我要将心腹就是羔羊的', '17', '0', '37', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('704', '279540', '281170', '七只给你看，', '17', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('705', '281180', '286410', '我被生命感动坚持就太过了一座', '18', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('706', '286430', '291230', '大单，江南有什么同样的量。', '18', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('707', '291250', '293790', '盛典了。', '18', '0', '4', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('708', '293810', '294710', '吗！', '19', '0', '3', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('709', '294730', '305520', '城中有神的荣耀，程的光辉如同即贵的宝石，好像碧玉名如水晶，高大。', '20', '0', '24', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('710', '305530', '312010', '上合并闭上有12位电视北上悠闲以色列！', '21', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('711', '312010', '314560', '刚才的男子。', '22', '0', '5', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('712', '314580', '322680', '东边有三门，北边有三门，南边有三门，西边有三门，加油！', '23', '0', '23', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('713', '322690', '328050', '分集边上梁二十三一四。', '24', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('714', '328240', '334230', '对我说话呢拿着经纬子档齿，要量那城和成文！', '25', '0', '19', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('715', '334230', '335390', '程强！', '26', '0', '4', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('716', '335410', '340800', '程是四床的长宽，银行天使用为两岸', '27', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('717', '340940', '344380', '共有4000米，长宽。', '27', '0', '5', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('718', '344400', '346210', '有新的一样，', '27', '0', '5', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('719', '346230', '355130', '又量了城墙，按着人的尺寸，就是天使的尺寸，共有144种。', '27', '0', '21', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('720', '355190', '361870', '十九二城市平均的功名进的管理城墙！', '28', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('721', '361880', '373790', '的根基是用各样宝石修饰的，第一根基是碧玉，第二是蓝宝石，第三是绿马马，第四是绿宝石。', '29', '0', '32', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('722', '373800', '385000', '第五是神马？60号是第七是皇帝戏，第二是成语，第九是红笔芯。', '30', '0', '25', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('723', '385010', '388300', '历史之ACB11是吧？', '30', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('724', '388310', '391150', '啊第12是资金十。', '30', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('725', '391160', '396240', '二个门是12颗珍珠，每门是一颗珍珠，', '31', '0', '15', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('726', '396260', '400650', '城内的街道是京津，好像明透的玻璃。', '31', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('727', '400660', '403440', '我为没有电！', '32', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('728', '403440', '408570', '宾主是连战的！汪洋为啥点。', '33', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('729', '408580', '411730', '那城内又不用日月光照！', '34', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('730', '411730', '417080', '因为有神的荣耀光照，又有高杨伟长的灯。', '35', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('731', '417090', '425700', '烈火要在神的光行走地上，君王并将G的荣耀归与大肠！', '36', '0', '20', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('732', '425710', '425930', '陈！', '37', '0', '2', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('733', '425940', '430810', '因为白昼总部关闭在那里，原没有黑夜，', '37', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('734', '430820', '433710', '人民将灭活的荣耀！', '38', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('735', '433710', '436010', '尊贵为大凡！', '39', '0', '5', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('736', '436020', '447820', '不洁净并那行可憎与虚谎之事的总不得劲，那成只有名字写在羔羊生命册上才得进去。', '40', '0', '30', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('737', '448210', '457510', '好，这是我们读的这章经文，啊这章经文呢基本上可以分为两部分，第一个部分是讲到新天新地，', '40', '0', '33', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('738', '457910', '461180', '第二个部分呢讲到新耶路撒冷。', '40', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('739', '461230', '466570', '新天新地的核心就是圣城新耶路撒冷。', '41', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('740', '466770', '469860', '讲到新天新地的时候讲到说，', '41', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('741', '470100', '478850', '时的帐幕在人间，谁要与人同住，他要擦干人所有的眼泪，消除人所有的痛苦。', '41', '0', '27', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('742', '479180', '484570', '整到新圣城新耶路撒冷的时候，对他有一个简单的介绍，', '41', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('743', '484590', '485920', '讲到', '41', '0', '2', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('744', '486660', '497590', '他这个啊12个门，每一个门都是珍珠，然后上面写着有12支派的名字，有12使徒的名字是非常的荣耀。', '41', '0', '34', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('745', '498320', '508690', '所以我们的大纲有两方面，第一个方面是新天新地，啊第二点是讲到西耶路撒冷。我们首先来看第一点，今天新地。', '41', '0', '39', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('746', '510460', '521020', '约翰告诉我们说，旧有的世界就有的天地，就是今天这个天地在基督再来的时候都要成为过去。', '42', '0', '27', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('747', '521660', '527750', '在传道书第一章里面讲到说，人类的历史是一个封闭的圆。', '42', '0', '18', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('748', '527840', '531960', '啊因为所以我们讲到说日光之下，', '42', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('749', '531980', '534850', 'B5心是一代过来，', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('750', '534860', '541240', '一代过去，一代又来，人类的历史好像就是一个封闭的园，', '42', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('751', '541260', '543700', '一直在循环。', '42', '0', '4', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('752', '544720', '549780', '但是在神那里，人类的历史它不只是一个封闭的圆，', '42', '0', '16', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('753', '550040', '557430', '人类的历史在神的手中一直在向前，直到有一天有一个结束的时间。', '42', '0', '19', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('754', '557790', '563040', '在整个人类历史的长河当中，有一件事是最为重要的，', '42', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('755', '563050', '565530', '就是神对世人的救赎。', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('756', '566240', '571310', '如果不在这个救赎当中，当这个旧的事件结束的时候，', '42', '0', '16', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('757', '571320', '574150', '人的生命也就走到了尽头。', '42', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('758', '574400', '583070', '如果我们在神的救赎当中，当旧的天地结束的时候，我们会进入到一个新天新地的当中，', '42', '0', '28', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('759', '584890', '597400', '讲到新天新地的时候，新耶路撒冷是他的最核心的组成的部分，啊这里讲到圣城从天而降，如同新妇等候丈夫。', '42', '0', '33', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('760', '597860', '607070', '那这个新的耶路撒冷代表什么？呢它代表完全脱离了罪，脱离了死亡等等这些人间痛苦的地方。', '42', '0', '26', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('761', '607820', '614150', '这个新耶路撒冷它代表是神赐给圣徒最宝贵的礼物。', '42', '0', '15', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('762', '614210', '619020', '这个新药的撒冷被称为是耶稣基督的新妇。', '42', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('763', '619030', '622360', '一般来说教会被称为新妇，', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('764', '622790', '625540', '属神的人被称为心腹，', '42', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('765', '625560', '629360', '为什么这一座城也会成为心腹？呢', '42', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('766', '629370', '637480', '因为这座城它就象征着基督徒对神的那一种纯洁和奉献。', '42', '0', '18', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('767', '637720', '646760', '所以当我们向心腹一样等候神的时候，神为我们大家所预备的这个圣城，也是如同新妇一样，', '42', '0', '27', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('768', '646780', '649670', '与我们一同的等候神，', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('769', '650790', '653140', '这是我们荣耀的盼望。', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('770', '653150', '657740', '这座圣城呢也是所有古圣先贤的盼望，', '42', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('771', '657760', '662840', '啊像亚伯拉罕以萨雅歌，他们盼望不在地上，', '42', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('772', '663020', '668240', '他们的盼望在天上是这一座有根基的城，', '42', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('773', '668680', '672140', '那么这也应该是我们的盼望。', '42', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('774', '672430', '681400', '在第一次世界大战和第二次世界大战之前，西方人的意识形态有一点浮躁。', '42', '0', '19', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('775', '681610', '684640', '因为在一战和二战之前，呢', '42', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('776', '685080', '696810', '科学在不断地发展，经济在不断的增长，制度在不断的完善，人的福利待遇也越来越好，人觉得他们不需要上帝了，', '42', '0', '34', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('777', '697060', '701830', '他们能够在地上建立一个理想的国度。', '42', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('778', '701840', '704540', '但是第一次世界大战的发生，', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('779', '704560', '707130', '第二次世界大战的发生，', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('780', '707140', '711640', '让人们再次看到人性深处的罪恶和杀戮。', '42', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('781', '711650', '721060', '那个时候这些所谓的西方的基督教的国家才真正的明白，在地上不可能建立一个理想的国度。', '42', '0', '25', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('782', '721470', '727770', '所以在一战和二战之后，很多人的信仰又重新回归到上帝那里，', '42', '0', '19', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('783', '727780', '729400', '啊这个是非常', '42', '0', '4', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('784', '729470', '732200', '值得我们大家思考的一个地方。', '42', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('785', '732230', '737800', '然后这个圣城又被称为什么？呢又被称为是神的帐幕。', '42', '0', '18', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('786', '738000', '745670', '当新耶路撒冷从天而降的时候，声音说，看到神的帐幕在人间。', '42', '0', '18', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('787', '746020', '750510', '从人类历史的开始到人类历史的结束，', '42', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('788', '750520', '754060', '有哪一些地方被称为是神的账目呢', '42', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('789', '755840', '759970', '神的账目就代表神与人同在的地方。', '42', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('790', '759980', '763720', '第一个账目可以说就是伊甸园，', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('791', '763780', '766010', '是神与人同在的地方。', '42', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('792', '766030', '771650', '但是当人犯罪以后，呢人们猪出了伊甸园，神不再与人同在。', '42', '0', '20', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('793', '771670', '776640', '第二个账目呢就是莫西在旷野当中所造的会幕，', '42', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('794', '776650', '778790', '啊神与他们同在。', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('795', '778810', '785000', '第三个就是他们进入到迦南地以后，他们所建造的圣殿。', '42', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('796', '785350', '790300', '第四个呢就是耶稣基督道成肉身的本身，', '42', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('797', '790820', '792760', '甚至讲到说，', '42', '0', '5', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('798', '792780', '807500', '道成了肉身住在我们中间，充充满满的有恩典，有真理。当讲到耶稣住在人的中间的时候，这个住这个字呢是一个非常重要的神学词汇。', '42', '0', '41', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('799', '807520', '810870', '耶稣住在人的中间，这个柱子', '42', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('800', '810880', '813970', '它的意思就是只发帐篷，', '42', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('801', '814400', '817680', '啊就是只搭帐篷直达账目的意思。', '42', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('802', '817690', '828550', '所以当耶稣道成肉身在人的中间居住的时候，那个也是神的帐幕在人间，耶稣的身体就是神的殿。', '42', '0', '32', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('803', '828560', '834560', '啊所以耶稣说你们拆毁这殿，我3日之内就把它建造起来。', '42', '0', '18', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('804', '834580', '838670', '所以耶稣他自己本身也就是神的帐幕。', '42', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('805', '839540', '843530', '第五个方面，呢教会也是神的账目，', '42', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('806', '843540', '845410', '将会被称为是', '42', '0', '4', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('807', '845430', '850060', '耶稣基督的身体，也是神人相会的地方。', '42', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('808', '850220', '856250', '耶稣说你们三二人同心合意的祷告，我就在你们的中间。', '42', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('809', '856510', '861910', '所以亲爱的弟兄姐妹们，教会对我们每一个人来说是非常重要的。', '42', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('810', '861930', '866340', '因为这是神所命定的神人相会的地方。', '42', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('811', '866360', '876190', '当然我们自己可不可以跟谁有交通，有祷告呢当然可以，但是教会这个交通方式是谁？特别命令是特别重要的。', '42', '0', '30', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('812', '877670', '884410', '那么最后一个神的帐幕在人间，就是新圣城耶路撒冷从天而降，', '42', '0', '16', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('813', '884760', '891640', '正是神的帐目最终的实现完全的实现，神他就住在', '42', '0', '16', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('814', '891650', '893050', '人的中间。', '42', '0', '4', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('815', '893070', '897170', '所以这些过程都被称为是神的帐幕。', '42', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('816', '897190', '904690', '但是新圣城耶路撒冷从天而降的时候，它是一个完全的实现。', '42', '0', '15', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('817', '906020', '914630', '当时宣告他的帐幕在人间以后，他说他要与人同住，他要做他们的神，他们要作他的子民。', '42', '0', '32', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('818', '915310', '926020', '这是圣经当中神与人力的所有约的共同的核心内容，就是谁要做我们的神，我们要做他的子民。', '42', '0', '31', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('819', '926040', '929940', '这是神与人互动的核心，就是这句话。', '42', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('820', '929950', '933880', '而这句话的核心就是神同在。', '42', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('821', '934430', '938730', '神的帐幕降临以后，圣经最强调的就是', '42', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('822', '938740', '942500', '他要与我们同在，他要与我们同住。', '42', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('823', '943160', '948870', '墨西再回埃及带领百姓进迦南的过程当中，他有很多问题，', '42', '0', '18', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('824', '949300', '952850', '如何面对法老？如何面对百姓？', '42', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('825', '953170', '957870', '如何面对他，遇到各样的难处，谁给他的答案只有一个，', '42', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('826', '957890', '959790', '就是我与你同在。', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('827', '960020', '962620', '这是一个最宝贵的应许，啊', '42', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('828', '962640', '971560', '所以无论在任何情况下，没膝都抓住这一个应许神，呢你要与我同在！什么叫同在呢', '42', '0', '28', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('829', '972660', '976490', '在约翰菲一章第一节讲的比较清楚，', '42', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('830', '976510', '980600', '太初有道，道与神同在，到就是谁？', '42', '0', '15', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('831', '980620', '984480', '那个同在的意思就是面对面。', '42', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('832', '984530', '988310', '他表达是一种非常亲密的关系。', '42', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('833', '989240', '996220', '以色列人过新年的时候，他们的大祭司都会为全国的百姓来祝福，', '42', '0', '18', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('834', '996230', '999380', '这个祝福的话不是他随意发挥的，', '42', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('835', '999390', '1003200', '是神教，他怎么说他就要怎么说的。', '42', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('836', '1003830', '1011920', '在大祭司为百姓的祝福当中有一句话说，愿耶和华用他的脸光照你，', '42', '0', '20', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('837', '1012210', '1015410', '愿耶和华向你仰脸。', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('838', '1015710', '1021020', '那当神向我们仰脸的时候，就是代表他的同在', '42', '0', '16', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('839', '1021040', '1023770', '就是代表他与我们面对面，', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('840', '1023950', '1027300', '愿他用他的脸光照我们。', '42', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('841', '1027320', '1031340', '那神的同在，神的面对面能带来什么？', '42', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('842', '1031360', '1038800', '能带来光照，这个光照呢就是在生活当中的引导，在生活当中的代理。', '42', '0', '20', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('843', '1039080', '1042470', '有了神的同在，就有神的光照，', '42', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('844', '1042480', '1049720', '有了什么同在进入时呢引导，最后谁的代理就有什么力量，就有什么保护。', '42', '0', '23', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('845', '1049740', '1055400', '所以我们说神的同在是解决所有问题的关键。', '42', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('846', '1056060', '1062290', '曾经有弟兄姐妹问过一个问题，可能也是我们有一些弟兄姐妹的问题。', '42', '0', '20', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('847', '1062410', '1067930', '他说他也有每一天的读经祷告以及礼拜天的聚会，', '42', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('848', '1068040', '1071580', '但是心里面呢还是非常的苦干，', '42', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('849', '1071660', '1074720', '与主的关系呢还是很疏远。', '42', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('850', '1074960', '1077390', '这个问题出在哪里呢？', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('851', '1078350', '1088900', '这个问题就出在虽然每一天有读经有祷告，每一周有聚会，但是在读经中在祷告中，在聚会中并没有遇见神，', '42', '0', '38', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('852', '1089240', '1091000', '这才是关键。', '42', '0', '5', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('853', '1091710', '1094130', '所以它里面还是苦干的，', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('854', '1094160', '1098360', '整个属灵的生命还是软弱的，还是无力的。', '42', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('855', '1099310', '1104090', '我们有没有遇点神，其实我们心里是清楚的。', '42', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('856', '1104860', '1110110', '那有时候我们说我不知道我有没有遇见，不知道有没有遇见，就是没遇见。', '42', '0', '20', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('857', '1110120', '1113240', '因为若是遇见了就一定是知道的，', '42', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('858', '1113680', '1116940', '甚至说你若尝过主恩的滋味，', '42', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('859', '1116950', '1121750', '便知道他是何等的美善，遇见神，我们一定是知道，', '42', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('860', '1121760', '1124510', '不知道有没有遇见，那就是没遇见。', '42', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('861', '1126140', '1133960', '所以圣经告诉我们说，神同在是我们解决生活当中所有问题的一个关键，', '42', '0', '20', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('862', '1134490', '1137310', '生存在不是一劳永逸的事情。', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('863', '1137320', '1142480', '不是，我今天有点神了，我自然而然在明天也能预见是', '42', '0', '16', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('864', '1142760', '1145750', '遇见神应该是每一天的追求，', '42', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('865', '1145850', '1148060', '是每一天的渴慕。', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('866', '1148370', '1159330', '今天遇见不代表明天仍然能够遇见，我们需要不断地接近自己，预备自己，对它有一个极大的渴慕，才能保守与他的关系。', '42', '0', '34', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('867', '1161530', '1170660', '今天CD来到以后，呢圣徒的生活的处境也改变了，首先就讲到说神要擦去我们一切的眼泪。', '42', '0', '29', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('868', '1171150', '1175480', '为什么说是要擦去我们的眼泪？呢因为这个社会', '42', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('869', '1175630', '1178890', '我们现实的生活有很多的痛苦，', '42', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('870', '1179270', '1184040', '所以我们讲到一个人的一生的时候，有一个简单的概括，', '42', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('871', '1185190', '1189990', '一个人的一生在自己的眼泪当中来到这个世界，', '42', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('872', '1190430', '1192950', '小孩一出生就是哭，对不对？', '42', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('873', '1193270', '1196790', '然后呢在别人的哭声当中', '42', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('874', '1196840', '1198230', '离开这个世界。', '42', '0', '5', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('875', '1199270', '1202560', '所以人的一生啊是从眼泪开始，', '43', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('876', '1202760', '1205010', '也是从眼泪结束的。', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('877', '1205220', '1208340', '人的一生总是有很多的痛苦，', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('878', '1209790', '1212610', '圣经并没有要帮我们解决', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('879', '1212630', '1215010', '生活当中所有的痛苦。', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('880', '1215030', '1218600', '当神为我们预备的有一个荣耀的未来，', '43', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('881', '1218740', '1221700', '时预备的有一个荣耀的盼望，', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('882', '1221720', '1225210', '甚至今天我们生活当中所遇到的苦难，', '43', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('883', '1225230', '1227100', '有神的许可，', '43', '0', '4', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('884', '1227200', '1232360', '或者说对我们的生命是一个重要的陶造的部分，', '43', '0', '15', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('885', '1232950', '1236350', '有来跟大家讲过一个真实的见证，', '43', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('886', '1236850', '1238830', '说在文革期间，', '43', '0', '5', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('887', '1238840', '1241340', '有一个中国老基督徒，', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('888', '1241360', '1245700', '因着儿女在美国，他也就搬到美国去生活。', '43', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('889', '1245930', '1254710', '进进到美国到美国以后，呢在美国也参加聚会，但是他总是感觉到美国教会跟中国教会有不一样的地方，', '43', '0', '31', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('890', '1255150', '1260470', '什么地方不一样，他也说不清楚，后来他找到问题所在了，', '43', '0', '18', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('891', '1260780', '1266580', '他说在中国教会聚会的时候，啊每一次传道人都讲主的再来', '43', '0', '20', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('892', '1266790', '1268920', '都讲将来的盼望。', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('893', '1269020', '1272940', '当时去美国以后，这美国将会不讲主再来，', '43', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('894', '1273140', '1276060', '这美国这会不讲将来的盼望，', '43', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('895', '1276580', '1279550', '他就觉得很纳闷，不知道为什么。', '43', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('896', '1279710', '1282410', '后来呢他找到了答案，', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('897', '1282550', '1288590', '因为中国教会一直在苦难中一直在逼迫中，大家讲不讲未来，', '43', '0', '18', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('898', '1288600', '1290580', '大家讲不讲盼望，', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('899', '1290590', '1293670', '都巴望着说，主耶稣你快来吧。', '43', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('900', '1294050', '1299400', '但是到美国以后呢没有逼迫，环境是自由的，', '43', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('901', '1299420', '1303900', '物质生活是丰富的，他们盼望主再来，嘛', '43', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('902', '1305240', '1309250', '他们也是怕忘，但是这个心就不强烈。', '43', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('903', '1309910', '1312960', '有一个弟兄我们关系非常好，', '43', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('904', '1314060', '1318090', '他年龄跟我差不多，啊去年前年才结婚，', '43', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('905', '1318330', '1321690', '所以应该是属于大龄晚婚的这种。', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('906', '1322430', '1325560', '他在结婚以前呢他常常有一个盼望，', '43', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('907', '1325870', '1329020', '世界赶紧毁灭，吧都毁灭算了。', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('908', '1329330', '1335330', '现在结完婚以后，呢它也不巴望着世界毁灭了，她对生活充满了向往。', '43', '0', '22', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('909', '1335480', '1337690', '所以人的处境的不同，', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('910', '1337730', '1341470', '他对神的再来的他们的程度就是不同了。', '43', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('911', '1342210', '1350890', '所以我们生活在这个世界上，弟兄姐妹的确会有很多的难处，如果没有难处的话，我们怎么会有属天的盼望呢？', '43', '0', '33', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('912', '1351140', '1359540', '所以苦难本身也是有价值的，可是当基督再来的时候，他就要彻底的擦干我们所有的眼泪，', '43', '0', '27', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('913', '1361110', '1371710', '所有的眼泪他都要擦干，她要带给我们安慰，在那个时候呢没有死亡，没有悲伤，没有哭嚎也没有疼痛，', '43', '0', '32', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('914', '1371730', '1373950', '这一些负面的情绪，', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('915', '1373960', '1378690', '这些艰难的处境，神通通都把它挪去了。', '43', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('916', '1378750', '1381830', '那是我们最终得数的时候，', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('917', '1382730', '1388830', '不仅夺去我们所有的难处，并且让我们承受天上的经验。', '43', '0', '16', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('918', '1388850', '1393470', '所以对于基督徒来说，不仅有基督，我们还有积液。', '43', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('919', '1393620', '1398390', '我们喝到生命前的水，我们得着了儿子的名分，', '43', '0', '16', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('920', '1398400', '1402050', '以儿子的名分来承受基因。', '43', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('921', '1402400', '1406000', '我们不是故宫，不是打工的得工价，', '43', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('922', '1406090', '1409860', '而是以儿子的名分来承受产业。', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('923', '1411170', '1413200', '当然对于那些', '43', '0', '3', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('924', '1413580', '1418290', '没有依靠神到底的，就非常可悲，就落在审判当中。', '43', '0', '15', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('925', '1419220', '1430500', '讲到胆怯的，不信的可颂的杀人的淫乱，拜偶像，他们的份就在烧着硫磺的火湖当中，这个审判是一直到永远。', '43', '0', '37', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('926', '1431620', '1438660', '当我们讲到审审判这一切的人的时候，把哪一个人排在第一位，大家有留心吗？', '43', '0', '26', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('927', '1439420', '1446380', '在审审判的这些对象，或者说这些罪恶当中，把哪个排在第一位？', '43', '0', '19', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('928', '1447060', '1448120', '但切', '43', '0', '2', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('929', '1448480', '1450760', '把胆怯排在第一位，', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('930', '1450850', '1453870', '为什么把胆怯的排在第一位呢？', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('931', '1455120', '1458830', '这跟约翰写作启示录的背景有关。', '43', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('932', '1458850', '1463130', '约翰岁起事故的时候就会处在一个怎样的状况底下？', '43', '0', '15', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('933', '1464120', '1466370', '手逼迫的状况底下。', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('934', '1466550', '1469650', '啊所以当时很多圣徒被杀害，', '43', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('935', '1469700', '1472370', '有许多的脚会被冲散，', '43', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('936', '1473240', '1475990', '应该限制负很大的代价。', '43', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('937', '1476000', '1479730', '所以有很多人应该道歉就离开信仰。', '43', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('938', '1480050', '1488340', '所以神在这里给出一个警告，当审判的时候，排在第一位的就是这一切胆怯的，', '43', '0', '24', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('939', '1488380', '1492680', '就是在信仰当中不能够一直坚持下来的。', '43', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('940', '1492690', '1495390', '这个神非常重要的提醒。', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('941', '1496290', '1500600', '我常常跟刚跟弟兄姐妹分享说跟随主难不难？', '43', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('942', '1500900', '1502960', '十字架的路不容易，', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('943', '1502970', '1504960', '但是不跟随主呢', '43', '0', '5', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('944', '1505150', '1506740', '我们会更难！', '43', '0', '5', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('945', '1507320', '1509930', '跟随主的男友价值，', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('946', '1510000', '1511860', '不跟随主的更难，', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('947', '1511870', '1513060', '没有价值，', '43', '0', '3', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('948', '1513070', '1515470', '最终是要灭亡的。', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('949', '1515630', '1518560', '所以跟随主的人是需要勇气的，', '43', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('950', '1519950', '1524480', '当我们实践信仰的时候也是需要勇气的。', '43', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('951', '1525930', '1530720', '好，接下来我们就分享第二点，第二个内容，啊西药用骚了。', '43', '0', '21', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('952', '1530900', '1535560', '新天新地的核心就是锡业路撒冷。', '43', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('953', '1535700', '1539310', '新耶路撒冷被称为是基督的新妇，', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('954', '1539330', '1541600', '被称为是神的帐幕，', '43', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('955', '1541610', '1545700', '也被称为是圣徒的居所，', '43', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('956', '1545720', '1548080', '啊被称为圣徒的居所。', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('957', '1549270', '1555280', '那这个新耶路撒冷圣城这个城的样式是什么样的一个样式呢？', '43', '0', '16', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('958', '1555860', '1559590', '有12个门，每一个门上有12位天使，', '43', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('959', '1559600', '1561110', '应该是说', '43', '0', '3', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('960', '1561130', '1563790', '一个很神圣很庄严的地方，', '43', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('961', '1563890', '1567550', '然后呢每一个门上刻着12支派的名字。', '43', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('962', '1567680', '1576520', '当然这个12之派呢它所代表的不只是以色列人，就代表所有属神的人，因为12是一个完全数，', '43', '0', '30', '2019-03-18 16:33:54', '更新的世界.m4a');
