INSERT INTO `text` VALUES ('966', '1591510', '1603620', '当讲到12使徒的时候，他的名字写在根基上，就应验了保罗所说的话，神的国是建立在使徒和先知的教训上面。', '43', '0', '38', '2019-03-18 16:33:54', '更新的世界.m4a');
