INSERT INTO `text` VALUES ('968', '1611490', '1617370', '然后呢又有天使拿一个经纬子当作尺子，就把成量一量。', '43', '0', '19', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('969', '1618970', '1621190', '这个量一量代表什么呢？', '43', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('970', '1621200', '1624490', '就代表神对整个城的保护，', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('971', '1624740', '1627800', '整个圣城在谁的遮盖当中？', '43', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('972', '1628410', '1632210', '这个城呢它的轮廓是一个正方体，长宽。', '43', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
