INSERT INTO `text` VALUES ('974', '1635000', '1636800', '都是4000里，', '43', '0', '3', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('975', '1637350', '1639300', '方方正正的。', '43', '0', '3', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('976', '1640230', '1642710', '中国有没有城市是方，呢', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('977', '1644730', '1647310', '中国有一个城市叫做方程，', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
