INSERT INTO `text` VALUES ('979', '1649340', '1657130', '但是这个城呢不只是方的，啊它是一个正方体，长宽高都是4000米，', '43', '0', '21', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('980', '1657370', '1661620', '这让我们想到了圣殿当中的至圣所。', '43', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
