INSERT INTO `text` VALUES ('989', '1694370', '1697140', '另外一方面聊完了以后发现', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('990', '1697250', '1701920', '人的尺寸和天使的尺寸是一模一样的。', '43', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('991', '1702110', '1706820', '是多少？呢144种，啊一种就是从指尖', '43', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
