INSERT INTO `text` VALUES ('994', '1713140', '1717740', '这个144是怎么来的？呢约翰是一个特别喜欢数字的', '43', '0', '15', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('995', '1717750', '1719030', '神学家。', '43', '0', '3', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('996', '1719310', '1722420', '144来自于12×12，', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('997', '1722430', '1725190', '啊代表是绝对的完全', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('998', '1725210', '1730240', '表示在食的上乘当中，无论是得救的圣徒，还是天使，', '43', '0', '15', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('999', '1730260', '1735770', '都完全按照神的旨意来，生活是完全的。', '43', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1000', '1735780', '1740930', '所以备粮的时候，呢人的尺寸才是12×12。', '43', '0', '16', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1001', '1741300', '1747010', '这个12乘是不是我们的身高不是我们的腰围，它是一个象征性的，', '43', '0', '18', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1002', '1747020', '1750350', '就代表说我们是完全的。', '43', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1003', '1753040', '1758970', '第二个方面来讨论一下这个成的材质，它用什么材质来建造的。', '43', '0', '20', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1004', '1759010', '1764560', '今天的城市高楼大厦说这钢筋混凝土建造的。', '43', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1005', '1764570', '1768580', '那么圣城耶路撒冷是用什么材质建造的呢？', '43', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1006', '1768600', '1770090', '经常说。', '43', '0', '3', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1007', '1770220', '1771410', '他的', '43', '0', '2', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1008', '1771420', '1772670', '城市', '43', '0', '1', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1009', '1772680', '1779920', '碧玉，而这个强势域乘是京津，根基呢是宝石，', '43', '0', '15', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1010', '1780050', '1785770', '那是不是将来整个圣城耶路撒冷就是这样的一个珠光宝气，呢', '43', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
