INSERT INTO `text` VALUES ('1012', '1788870', '1793050', '约翰只是用人间最好的东西来描述，', '43', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1013', '1793250', '1797430', '为了衬托神的荣耀与圣洁，', '43', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1014', '1797450', '1801840', '衬托信徒的尊贵和美好的品性。', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1015', '1802130', '1809550', '事实上讲到将来的圣城的时候，讲到将来的荣耀的时候，保罗曾经说过，', '43', '0', '21', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1016', '1809560', '1812380', '世人的眼没有看过，', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1017', '1812400', '1814680', '人的耳朵没有听过，', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
