INSERT INTO `text` VALUES ('1019', '1818110', '1821600', '绝对不是金银宝石可以衡量的。', '43', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1020', '1821700', '1829950', '但是约翰它只能用最好的东西去描述，事实上要比这个更好千倍百倍。', '43', '0', '20', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1021', '1831900', '1835440', '然后乘的根基呢是12样宝石。', '43', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1022', '1835460', '1844320', '这12样宝石呢11旧约设计当中，大祭司的胸前有12国宝石为背景的，', '43', '0', '21', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1023', '1844470', '1846410', '我们还这个大祭司嘛', '43', '0', '5', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1024', '1846620', '1848330', '穿着圣袍，', '43', '0', '4', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1025', '1848340', '1853810', '外面再套上一副得你负责的，前面有12个袋子都在show前，', '43', '0', '21', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1026', '1853820', '1858920', '每一个袋子里面装一块宝石，就带着以色列12支派，', '43', '0', '15', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1027', '1860880', '1869500', '所以成的根基是12种宝石，是以大菲斯胸前的12活宝石为背景的为基础的。', '43', '0', '26', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1028', '1869510', '1877180', '就是表示说神所有的救赎在新耶路撒冷的里面就完全的成就了。', '43', '0', '18', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1029', '1878290', '1893740', '大气司胸前的12本胸牌代表以色列12个支派代表着他，为所有的属神的百姓来祝福，来守望来祷告，在基督再来的时候就完全实现了。', '43', '0', '43', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1030', '1894230', '1897320', '对于我们来说，我们是不是祭司，呢', '43', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1031', '1897400', '1900690', '比如说我们是君尊的祭司，', '43', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
