INSERT INTO `text` VALUES ('1034', '1910650', '1915020', '也许我们说买不起宝石，啊没有那么多宝石挂在生前，', '43', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1035', '1915320', '1919860', '这12个宝石就代表着说，我们对神的子民的唉', '43', '0', '16', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1036', '1919870', '1924300', '对神的子民的责任和对使得子民的付出，', '43', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1037', '1924320', '1929030', '当然也包括用基督的方式对待我们的家人，', '43', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1038', '1929120', '1933540', '这一切将来在什么国度的里面都是被纪念的。', '43', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1039', '1934440', '1941080', '最后一点是讲到圣徒在圣城内的生活，经常说成就是店主，', '43', '0', '18', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1040', '1941850', '1943210', '就是电。', '43', '0', '3', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1041', '1943220', '1951820', '那个时候在上城里面不需要再建造一个圣殿，不需要再建一个教会，这个城本身就已经是神的圣殿了。', '43', '0', '31', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1042', '1951840', '1957130', '因为城市四方的是正方体，正如至圣所是一样的。', '43', '0', '16', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1043', '1958050', '1960920', '那个时候呢我们行在光中，', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1044', '1961820', '1963400', '神就是光，', '43', '0', '4', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1045', '1963490', '1969330', '主就是登那个时候呢不需要任何的这种照明设备。', '43', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1046', '1969620', '1976520', '不是，是不只是所有的灯光不需要了，连日光月光和星光都不需要了。', '43', '0', '22', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1047', '1977130', '1980600', '在雅歌书里面时被称为什么？', '43', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1048', '1980850', '1982950', '众光之父，啊', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1049', '1983530', '1990350', '它比日光月光星光更加的明亮，但绝对不会给人有那种刺眼的感觉。', '43', '0', '20', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1050', '1990730', '1993810', '他是众光之父，没有黑暗。', '43', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1051', '1993910', '1999510', '那个时候我们都完全行在光明当中，我们也穿着光明洁白的细码一。', '43', '0', '20', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1052', '1999750', '2005260', '第二个是说我们在食堂圣城当中，我们能够完全活出神的荣耀，', '43', '0', '20', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1053', '2005410', '2011790', '人里面的丝巾人里面的罪的杂念都完全被清除掉了。', '43', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1054', '2012500', '2022840', '我们把所有的荣耀都归给神，经常说包括君王都把荣耀归给谁，就代表说我们完全活在神的荣耀中。', '43', '0', '33', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1055', '2024110', '2029300', '并且讲到说城门白昼，总部关闭，那晚上关不关，呢', '43', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1056', '2030420', '2032550', '白天总部关闭，', '43', '0', '4', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1057', '2032590', '2035270', '晚上关不关，呢没有晚上，', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1058', '2035590', '2038030', '城门永远都不会关闭。', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1059', '2038190', '2040840', '不关闭，城门不关闭，', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1060', '2040850', '2044100', '安不安全，呢绝对的安全。', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1061', '2044120', '2048250', '现在我们每家每户都会用到一个东西，就叫做所', '43', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1062', '2048480', '2051570', '无论是自行车电动车', '43', '0', '3', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1063', '2051590', '2053930', '汽车还是我们的门，', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1064', '2054030', '2059230', '还是我们的保险柜，都需要有所所的存在，就证明人有罪。', '43', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1065', '2060240', '2063960', '但是在将来时的圣城里面的门是不关的，', '43', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1066', '2064190', '2071250', '因为没有强盗，没有小偷，协和在市里都被人消除了，我们里面的罪性也被清除了。', '43', '0', '26', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1067', '2071620', '2076730', '那个时候我们就得想真正的自由和平安，', '43', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1068', '2076840', '2079840', '我们就享受真正的安息。', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1069', '2081430', '2084130', '最后大家思考一个问题，', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1070', '2084160', '2091220', '在创造中啊6日创造第七日安息，在这七天当中，哪一天是高潮，', '43', '0', '24', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1071', '2091940', '2094060', '哪一天是最重要的。', '43', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1072', '2096760', '2103700', '一造争光，宇宙明儿造空气柱天青，就在这七天当中，哪一天最重要的？', '43', '0', '26', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1073', '2105870', '2107980', '一般认为是第六天。', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1074', '2108000', '2112250', '因为世人对创造知识创造了高潮。', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1075', '2112280', '2115200', '其实我认为应该是第七天，', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1076', '2115210', '2117410', '安息日才是高潮。', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1077', '2117990', '2122590', '因为安息日这一天是要留出来境外的，', '43', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1078', '2122700', '2124510', '敬拜才是高潮。', '43', '0', '5', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1079', '2126130', '2128250', '安琪这个时候神', '43', '0', '4', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1080', '2128260', '2133480', '就把所有的工作放下了，那神把工作放下，他要做什么？', '43', '0', '19', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1081', '2134560', '2137150', '他要接受人对他的敬拜。', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1082', '2137660', '2141080', '所以第七日安息日A级才是', '43', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1083', '2141100', '2143130', '神创造的高潮。', '43', '0', '5', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1084', '2143160', '2148310', '安息是神创造的高潮，也是神救赎的高潮。', '43', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1085', '2148600', '2155640', '所以神对我们拯救到最后的时候，一定让我们进入到那种完全的自由平安', '43', '0', '20', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1086', '2155660', '2157640', '与安息当中。', '43', '0', '4', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1087', '2158030', '2162360', '正如这里所讲的，圣城的门是不需要关闭的。', '43', '0', '15', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1088', '2163150', '2167590', '最后我们的结论呢是本章当中的一节经文，', '43', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1089', '2167600', '2170090', '是我们大家共同的勉励。', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1090', '2171170', '2175240', '我们一起来读这节经文启示录20章第七节。', '43', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1091', '2175260', '2183810', '得胜的必承受，这些为业，我要做他的神，他要做我的儿子。', '43', '0', '23', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1092', '2184800', '2187830', '那谁所预备的好不好呢？', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1093', '2188170', '2196790', '是非常好的。刚才我们看到了新天新地看到了新耶路撒冷，但是要想承受这一切，有一个条件，', '43', '0', '29', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1094', '2197120', '2198750', '我们要得胜。', '43', '0', '4', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1095', '2200080', '2206870', '这个得事就代表说，在千难万苦当中依然持守信仰前行。', '43', '0', '19', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1096', '2207020', '2213620', '这叫做得胜是最基本的，得胜的人要承受这些为业。', '43', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1097', '2215020', '2216980', '啊这个天上的基业，', '43', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1098', '2216990', '2221200', '把地上所有的财富加起来，也不能与他相比。', '43', '0', '14', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1099', '2222380', '2226990', '这第一个关键这一节经文的第一个关键就是得胜。', '43', '0', '15', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1100', '2227130', '2230280', '那第二个关键就是关系。', '43', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1101', '2230610', '2238490', '谁要做我们的神，我们要做他的儿子，这强调的是我们跟神的关系。', '43', '0', '24', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1102', '2239000', '2247850', '在我们所有的日常生活当中，教会生活当中最重要的一个部分，就是跟神的关系是怎么样的。', '43', '0', '26', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1103', '2248250', '2251740', '有一句话说我不讲到，有人讲到，', '43', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1104', '2252300', '2254720', '我不唱诗，有人唱诗，', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1105', '2254730', '2257780', '所以我的工作是可以由别人来代替的。', '43', '0', '12', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1106', '2257790', '2261050', '但是有一样东西是别人代替不了的，', '43', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1107', '2261060', '2263310', '这是我们跟神的关系。', '43', '0', '8', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1108', '2263740', '2269250', '弟兄姐妹无论读经也好，祷告也好，服饰也好，奉献也好，这都很重要。', '43', '0', '21', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1109', '2269260', '2271590', '但比这些更重要的是', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1110', '2271600', '2277910', '是我们跟神的关系到底是怎么样的，这个才是最重要的。', '43', '0', '18', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1111', '2279070', '2283990', '愿主开我们的眼，让我们看到将来那荣耀的盼望，', '43', '0', '16', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1112', '2284880', '2291220', '也愿神加给我们力量，是我们每一天都保守与他亲密的关系。', '43', '0', '21', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1113', '2291280', '2296380', '与神有了关系，我们做其他事情是事半功倍的。', '43', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1114', '2296430', '2302430', '于是没有关系，我们做其他事只是是事倍功半的，', '43', '0', '13', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1115', '2302690', '2304500', '啊这是不一样的。', '43', '0', '7', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1116', '2304510', '2308490', '好，乐臣伺候大家，我们早上信息就分享到这里。', '43', '0', '15', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1117', '2308660', '2319570', '啊以下有两个报告，第一个报告就是说前两个主日，我们大家奉献了一批旧衣服，啊我们准备捐到云南山区少数民族那里，', '43', '0', '36', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1118', '2319590', '2326440', '把我们不需要的东西，或者说我们额外付出的一个部分成为他们的帮助。', '43', '0', '20', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1119', '2327240', '2338120', '但是截止到这个主任，我们大家就不需要再往把这个衣服拿到交互里面来了，我们这一次捐献旧衣服的活动到今天就告一段落了。', '43', '0', '36', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1120', '2338140', '2342970', '啊教会也不是每一个主日都要来收集这些就医负担。', '43', '0', '16', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1121', '2343650', '2351190', '第二个报告就是应该说是一个见证，嘛一个感恩的分析啊神，保守我妻子平安顺利的生产。', '43', '0', '26', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1122', '2351290', '2354620', '啊就是3月12号就是', '43', '0', '4', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1123', '2354720', '2356650', '上礼拜二那天', '43', '0', '5', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1124', '2356810', '2361360', '啊平安顺利的生产，然后母子平安，也很感谢谁。', '43', '0', '15', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1125', '2361380', '2367540', '啊今天也预备了一些啊糖块和瓜子，分享这一个感恩的见证。', '43', '0', '19', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1126', '2367550', '2370410', '那最后想请常姨来做一个', '43', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1127', '2370430', '2377070', '啊祝福祷告，我们就可以分享一点这个糖果和瓜子，我们聚会就结束。', '43', '0', '19', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1128', '2377140', '2380410', '茶怡，你来做个结束祷告。', '43', '0', '11', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1129', '2381280', '2382650', '啊', '44', '0', '1', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1130', '2389000', '2390940', '移动。', '44', '0', '3', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1131', '2390950', '2393040', '这个我倒是就希望你这么高！', '45', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1132', '2396760', '2399150', '请啊也是我们感谢您！', '46', '0', '9', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1133', '2399150', '2400210', '谢谢你！', '47', '0', '4', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1134', '2400210', '2426550', '在你的带领保守下已经是能够是临界平安生产，这一切终要归给我们天上的神助，也也恳求恳求朱也也也就听了我们众弟兄什么的斗狗这真是胜利大的面，这个家庭他们一生这样的全家释放你爱你全心的奉献，只求你在', '48', '0', '69', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1135', '2426560', '2450790', '天上纪念在地上大大的祝福他们他们的爱心说说现在禁物主要求你要祝福他们，使他们无处可容，叫每个弟兄姊妹分享的时间成一个感恩的心来领受我们谢谢耶稣，就够垂听孩子我们的斗狗祷告，祈求奉耶稣这个名丘。', '48', '0', '65', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1136', '2450800', '2453960', '好，我们一同起立主祷文！', '48', '0', '10', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1137', '2456900', '2458600', '耶稣教导我们说，', '49', '0', '5', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1138', '2458610', '2485880', '门在天上的父愿人都经历了议会上院一的国降临，远远是隐行在地上，如同行在天上，我们就在饮食，今日赐给我们练我们的债，如同我们免人的在不叫我们遇见，试探救我们，脱离胸和，因为国度权柄，荣耀全是你的，直到永远，啊', '49', '0', '76', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1139', '2485890', '2486940', '妹。', '49', '0', '3', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1140', '2486950', '2489870', '啊愿神赐后，大家那就在后面放，大家可以。', '50', '0', '17', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1141', '2489880', '2493140', '上下载的都。', '51', '0', '6', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1142', '2494010', '2495080', '不是', '52', '0', '1', '2019-03-18 16:33:54', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1143', '34710', '38990', '用姐妹准备平安，我们再次来现场，到到', '0', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1144', '40000', '47550', '现在就着耶稣基督，我们感谢你在清晨的时候用你的爱吸引我们再次来到你的殿中。', '0', '0', '27', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1145', '48170', '51740', '我们愿意带着心灵和诚实来敬拜你！', '1', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1146', '51760', '73080', '求你赐给我们像玛利亚那样有谦卑受教的新作，今天在我们聚会的时候，你的宝座就在我们中间，你的账目也在我们中间，你要问我们每一个人的平安，要擦去我们所有人的眼泪，只要我们盼望在今天的机会当中能够遇见你！', '2', '0', '70', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1147', '73090', '88500', '只有遇见你才是真正的聚会，只有遇见你才是真正的敬拜主，愿意按时分粮给我们每一个人愿意的保险，接近我们众人院里的胜利，在这里自由自在的运行，', '3', '0', '47', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1148', '88500', '92400', '我们这样同心祷告，奉耶稣基督得胜的名求。', '4', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1149', '92410', '93590', '唉。', '4', '0', '3', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1150', '94110', '101770', '想请问我们大家，在这个世界上有没有一些国家和地区是我们大家特别羡慕的？', '5', '0', '21', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1151', '103070', '114370', '如果说到一些国家和地区的话，那首先想到的就是欧美，这些国家是发达的，国家啊是繁荣的地区，很多人都很向往。', '5', '0', '36', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1152', '114390', '115970', '但是随着', '5', '0', '2', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1153', '115990', '123880', '最近一些事情的发生，随着枪击案的频频发生，我们发现欧美也不是天堂。', '5', '0', '20', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1154', '124370', '128470', '那今天我们分享的题目是更新的事件。', '5', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1155', '128710', '133780', '这是耶稣基督为我们最终所预备的圣徒所居住的地方，', '5', '0', '16', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1156', '133790', '138210', '那是真正的美好，就是我们传说中的天堂。', '5', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1157', '139260', '143970', '我们要看的经文是启示录的第21章，', '5', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1158', '147730', '149840', '啊是整章的经文。', '6', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1159', '149860', '155220', '我们弟兄读一节，姊妹读一节，我们先把这章的经文读一下。', '6', '0', '21', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1160', '155230', '159750', '当我们读这章经文的时候，呢我们可以带着喜乐的心，', '6', '0', '18', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1161', '159750', '164120', '因为这一切都是神应许给我们的。', '7', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1162', '164130', '165710', '好，我们弟兄就有些。', '7', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1163', '165720', '166590', '态度！', '8', '0', '3', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1164', '167020', '175650', '我又看见一个新天新地，因为以前的天地已经过去了，海也不再有了！', '9', '0', '23', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1165', '175660', '177370', '我又面临', '10', '0', '3', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1166', '177420', '181590', '新墙有时半天儿，', '10', '0', '6', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1167', '181600', '187920', '将预备好了，就清毒康是整齐等等。', '10', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1168', '187930', '206870', '我听见有大声音从宝座出来说，看哪神的帐幕在人间，他要与人同住，他们要作他的子民，谁要亲自与他们同在，做他们的神，让他们明确。', '11', '0', '50', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1169', '206880', '211450', '不再有死亡，也别再有回来过。', '12', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1170', '211460', '216030', '号没，因为以前的事都过去了。', '12', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1171', '216040', '227010', '坐宝座的说，看，我将一切都更新了，又说你要写上，因这些话是可信的，是真实的！', '13', '0', '33', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1172', '227020', '231070', '他有对我说，构成了我是爸爸。', '14', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1173', '231080', '240290', '我是我是说我是中我要将生命选择一些，明白自己的那个', '14', '0', '19', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1174', '240310', '242050', '得！', '14', '0', '3', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1175', '242060', '249680', '得胜的必承受这些为业，我要做他的神，他要做我的儿子！', '15', '0', '23', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1176', '249740', '267510', '有感谢的性格症的发生的淫乱性，接触的待项和一切说谎话，他们的份对外收着硫磺的红利，这是第二次拿。', '16', '0', '38', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1177', '267520', '279530', '着七个今晚成晚，没后期灾的七位天使中，有一位来对我说，你到我这里来，我要将心腹就是羔羊的', '17', '0', '37', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1178', '279540', '281170', '七只给你看，', '17', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1179', '281180', '286410', '我被生命感动坚持就太过了一座', '18', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1180', '286430', '291230', '大单，江南有什么同样的量。', '18', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1181', '291250', '293790', '盛典了。', '18', '0', '4', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1182', '293810', '294710', '吗！', '19', '0', '3', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1183', '294730', '305520', '城中有神的荣耀，程的光辉如同即贵的宝石，好像碧玉名如水晶，高大。', '20', '0', '24', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1184', '305530', '312010', '上合并闭上有12位电视北上悠闲以色列！', '21', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1185', '312010', '314560', '刚才的男子。', '22', '0', '5', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1186', '314580', '322680', '东边有三门，北边有三门，南边有三门，西边有三门，加油！', '23', '0', '23', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1187', '322690', '328050', '分集边上梁二十三一四。', '24', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1188', '328240', '334230', '对我说话呢拿着经纬子档齿，要量那城和成文！', '25', '0', '19', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1189', '334230', '335390', '程强！', '26', '0', '4', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1190', '335410', '340800', '程是四床的长宽，银行天使用为两岸', '27', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1191', '340940', '344380', '共有4000米，长宽。', '27', '0', '5', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1192', '344400', '346210', '有新的一样，', '27', '0', '5', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1193', '346230', '355130', '又量了城墙，按着人的尺寸，就是天使的尺寸，共有144种。', '27', '0', '21', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1194', '355190', '361870', '十九二城市平均的功名进的管理城墙！', '28', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1195', '361880', '373790', '的根基是用各样宝石修饰的，第一根基是碧玉，第二是蓝宝石，第三是绿马马，第四是绿宝石。', '29', '0', '32', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1196', '373800', '385000', '第五是神马？60号是第七是皇帝戏，第二是成语，第九是红笔芯。', '30', '0', '25', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1197', '385010', '388300', '历史之ACB11是吧？', '30', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1198', '388310', '391150', '啊第12是资金十。', '30', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1199', '391160', '396240', '二个门是12颗珍珠，每门是一颗珍珠，', '31', '0', '15', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1200', '396260', '400650', '城内的街道是京津，好像明透的玻璃。', '31', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1201', '400660', '403440', '我为没有电！', '32', '0', '6', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1202', '403440', '408570', '宾主是连战的！汪洋为啥点。', '33', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1203', '408580', '411730', '那城内又不用日月光照！', '34', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1204', '411730', '417080', '因为有神的荣耀光照，又有高杨伟长的灯。', '35', '0', '17', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1205', '417090', '425700', '烈火要在神的光行走地上，君王并将G的荣耀归与大肠！', '36', '0', '20', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1206', '425710', '425930', '陈！', '37', '0', '2', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1207', '425940', '430810', '因为白昼总部关闭在那里，原没有黑夜，', '37', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1208', '430820', '433710', '人民将灭活的荣耀！', '38', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1209', '433710', '436010', '尊贵为大凡！', '39', '0', '5', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1210', '436020', '447820', '不洁净并那行可憎与虚谎之事的总不得劲，那成只有名字写在羔羊生命册上才得进去。', '40', '0', '30', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1211', '448210', '457510', '好，这是我们读的这章经文，啊这章经文呢基本上可以分为两部分，第一个部分是讲到新天新地，', '40', '0', '33', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1212', '457910', '461180', '第二个部分呢讲到新耶路撒冷。', '40', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1213', '461230', '466570', '新天新地的核心就是圣城新耶路撒冷。', '41', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1214', '466770', '469860', '讲到新天新地的时候讲到说，', '41', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1215', '470100', '478850', '时的帐幕在人间，谁要与人同住，他要擦干人所有的眼泪，消除人所有的痛苦。', '41', '0', '27', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1216', '479180', '484570', '整到新圣城新耶路撒冷的时候，对他有一个简单的介绍，', '41', '0', '17', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1217', '484590', '485920', '讲到', '41', '0', '2', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1218', '486660', '497590', '他这个啊12个门，每一个门都是珍珠，然后上面写着有12支派的名字，有12使徒的名字是非常的荣耀。', '41', '0', '34', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1219', '498320', '508690', '所以我们的大纲有两方面，第一个方面是新天新地，啊第二点是讲到西耶路撒冷。我们首先来看第一点，今天新地。', '41', '0', '39', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1220', '510460', '521020', '约翰告诉我们说，旧有的世界就有的天地，就是今天这个天地在基督再来的时候都要成为过去。', '42', '0', '27', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1221', '521660', '527750', '在传道书第一章里面讲到说，人类的历史是一个封闭的圆。', '42', '0', '18', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1222', '527840', '531960', '啊因为所以我们讲到说日光之下，', '42', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1223', '531980', '534850', 'B5心是一代过来，', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1224', '534860', '541240', '一代过去，一代又来，人类的历史好像就是一个封闭的园，', '42', '0', '17', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1225', '541260', '543700', '一直在循环。', '42', '0', '4', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1226', '544720', '549780', '但是在神那里，人类的历史它不只是一个封闭的圆，', '42', '0', '16', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1227', '550040', '557430', '人类的历史在神的手中一直在向前，直到有一天有一个结束的时间。', '42', '0', '19', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1228', '557790', '563040', '在整个人类历史的长河当中，有一件事是最为重要的，', '42', '0', '17', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1229', '563050', '565530', '就是神对世人的救赎。', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1230', '566240', '571310', '如果不在这个救赎当中，当这个旧的事件结束的时候，', '42', '0', '16', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1231', '571320', '574150', '人的生命也就走到了尽头。', '42', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1232', '574400', '583070', '如果我们在神的救赎当中，当旧的天地结束的时候，我们会进入到一个新天新地的当中，', '42', '0', '28', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1233', '584890', '597400', '讲到新天新地的时候，新耶路撒冷是他的最核心的组成的部分，啊这里讲到圣城从天而降，如同新妇等候丈夫。', '42', '0', '33', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1234', '597860', '607070', '那这个新的耶路撒冷代表什么？呢它代表完全脱离了罪，脱离了死亡等等这些人间痛苦的地方。', '42', '0', '26', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1235', '607820', '614150', '这个新耶路撒冷它代表是神赐给圣徒最宝贵的礼物。', '42', '0', '15', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1236', '614210', '619020', '这个新药的撒冷被称为是耶稣基督的新妇。', '42', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1237', '619030', '622360', '一般来说教会被称为新妇，', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1238', '622790', '625540', '属神的人被称为心腹，', '42', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1239', '625560', '629360', '为什么这一座城也会成为心腹？呢', '42', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1240', '629370', '637480', '因为这座城它就象征着基督徒对神的那一种纯洁和奉献。', '42', '0', '18', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1241', '637720', '646760', '所以当我们向心腹一样等候神的时候，神为我们大家所预备的这个圣城，也是如同新妇一样，', '42', '0', '27', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1242', '646780', '649670', '与我们一同的等候神，', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1243', '650790', '653140', '这是我们荣耀的盼望。', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1244', '653150', '657740', '这座圣城呢也是所有古圣先贤的盼望，', '42', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1245', '657760', '662840', '啊像亚伯拉罕以萨雅歌，他们盼望不在地上，', '42', '0', '17', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1246', '663020', '668240', '他们的盼望在天上是这一座有根基的城，', '42', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1247', '668680', '672140', '那么这也应该是我们的盼望。', '42', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1248', '672430', '681400', '在第一次世界大战和第二次世界大战之前，西方人的意识形态有一点浮躁。', '42', '0', '19', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1249', '681610', '684640', '因为在一战和二战之前，呢', '42', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1250', '685080', '696810', '科学在不断地发展，经济在不断的增长，制度在不断的完善，人的福利待遇也越来越好，人觉得他们不需要上帝了，', '42', '0', '34', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1251', '697060', '701830', '他们能够在地上建立一个理想的国度。', '42', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1252', '701840', '704540', '但是第一次世界大战的发生，', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1253', '704560', '707130', '第二次世界大战的发生，', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1254', '707140', '711640', '让人们再次看到人性深处的罪恶和杀戮。', '42', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1255', '711650', '721060', '那个时候这些所谓的西方的基督教的国家才真正的明白，在地上不可能建立一个理想的国度。', '42', '0', '25', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1256', '721470', '727770', '所以在一战和二战之后，很多人的信仰又重新回归到上帝那里，', '42', '0', '19', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1257', '727780', '729400', '啊这个是非常', '42', '0', '4', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1258', '729470', '732200', '值得我们大家思考的一个地方。', '42', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1259', '732230', '737800', '然后这个圣城又被称为什么？呢又被称为是神的帐幕。', '42', '0', '18', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1260', '738000', '745670', '当新耶路撒冷从天而降的时候，声音说，看到神的帐幕在人间。', '42', '0', '18', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1261', '746020', '750510', '从人类历史的开始到人类历史的结束，', '42', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1262', '750520', '754060', '有哪一些地方被称为是神的账目呢', '42', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1263', '755840', '759970', '神的账目就代表神与人同在的地方。', '42', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1264', '759980', '763720', '第一个账目可以说就是伊甸园，', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1265', '763780', '766010', '是神与人同在的地方。', '42', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1266', '766030', '771650', '但是当人犯罪以后，呢人们猪出了伊甸园，神不再与人同在。', '42', '0', '20', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1267', '771670', '776640', '第二个账目呢就是莫西在旷野当中所造的会幕，', '42', '0', '17', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1268', '776650', '778790', '啊神与他们同在。', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1269', '778810', '785000', '第三个就是他们进入到迦南地以后，他们所建造的圣殿。', '42', '0', '17', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1270', '785350', '790300', '第四个呢就是耶稣基督道成肉身的本身，', '42', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1271', '790820', '792760', '甚至讲到说，', '42', '0', '5', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1272', '792780', '807500', '道成了肉身住在我们中间，充充满满的有恩典，有真理。当讲到耶稣住在人的中间的时候，这个住这个字呢是一个非常重要的神学词汇。', '42', '0', '41', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1273', '807520', '810870', '耶稣住在人的中间，这个柱子', '42', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1274', '810880', '813970', '它的意思就是只发帐篷，', '42', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1275', '814400', '817680', '啊就是只搭帐篷直达账目的意思。', '42', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1276', '817690', '828550', '所以当耶稣道成肉身在人的中间居住的时候，那个也是神的帐幕在人间，耶稣的身体就是神的殿。', '42', '0', '32', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1277', '828560', '834560', '啊所以耶稣说你们拆毁这殿，我3日之内就把它建造起来。', '42', '0', '18', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1278', '834580', '838670', '所以耶稣他自己本身也就是神的帐幕。', '42', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1279', '839540', '843530', '第五个方面，呢教会也是神的账目，', '42', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1280', '843540', '845410', '将会被称为是', '42', '0', '4', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1281', '845430', '850060', '耶稣基督的身体，也是神人相会的地方。', '42', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1282', '850220', '856250', '耶稣说你们三二人同心合意的祷告，我就在你们的中间。', '42', '0', '17', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1283', '856510', '861910', '所以亲爱的弟兄姐妹们，教会对我们每一个人来说是非常重要的。', '42', '0', '17', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1284', '861930', '866340', '因为这是神所命定的神人相会的地方。', '42', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1285', '866360', '876190', '当然我们自己可不可以跟谁有交通，有祷告呢当然可以，但是教会这个交通方式是谁？特别命令是特别重要的。', '42', '0', '30', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1286', '877670', '884410', '那么最后一个神的帐幕在人间，就是新圣城耶路撒冷从天而降，', '42', '0', '16', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1287', '884760', '891640', '正是神的帐目最终的实现完全的实现，神他就住在', '42', '0', '16', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1288', '891650', '893050', '人的中间。', '42', '0', '4', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1289', '893070', '897170', '所以这些过程都被称为是神的帐幕。', '42', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1290', '897190', '904690', '但是新圣城耶路撒冷从天而降的时候，它是一个完全的实现。', '42', '0', '15', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1291', '906020', '914630', '当时宣告他的帐幕在人间以后，他说他要与人同住，他要做他们的神，他们要作他的子民。', '42', '0', '32', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1292', '915310', '926020', '这是圣经当中神与人力的所有约的共同的核心内容，就是谁要做我们的神，我们要做他的子民。', '42', '0', '31', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1293', '926040', '929940', '这是神与人互动的核心，就是这句话。', '42', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1294', '929950', '933880', '而这句话的核心就是神同在。', '42', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1295', '934430', '938730', '神的帐幕降临以后，圣经最强调的就是', '42', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1296', '938740', '942500', '他要与我们同在，他要与我们同住。', '42', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1297', '943160', '948870', '墨西再回埃及带领百姓进迦南的过程当中，他有很多问题，', '42', '0', '18', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1298', '949300', '952850', '如何面对法老？如何面对百姓？', '42', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1299', '953170', '957870', '如何面对他，遇到各样的难处，谁给他的答案只有一个，', '42', '0', '17', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1300', '957890', '959790', '就是我与你同在。', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1301', '960020', '962620', '这是一个最宝贵的应许，啊', '42', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1302', '962640', '971560', '所以无论在任何情况下，没膝都抓住这一个应许神，呢你要与我同在！什么叫同在呢', '42', '0', '28', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1303', '972660', '976490', '在约翰菲一章第一节讲的比较清楚，', '42', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1304', '976510', '980600', '太初有道，道与神同在，到就是谁？', '42', '0', '15', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1305', '980620', '984480', '那个同在的意思就是面对面。', '42', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1306', '984530', '988310', '他表达是一种非常亲密的关系。', '42', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1307', '989240', '996220', '以色列人过新年的时候，他们的大祭司都会为全国的百姓来祝福，', '42', '0', '18', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1308', '996230', '999380', '这个祝福的话不是他随意发挥的，', '42', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1309', '999390', '1003200', '是神教，他怎么说他就要怎么说的。', '42', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1310', '1003830', '1011920', '在大祭司为百姓的祝福当中有一句话说，愿耶和华用他的脸光照你，', '42', '0', '20', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1311', '1012210', '1015410', '愿耶和华向你仰脸。', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1312', '1015710', '1021020', '那当神向我们仰脸的时候，就是代表他的同在', '42', '0', '16', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1313', '1021040', '1023770', '就是代表他与我们面对面，', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1314', '1023950', '1027300', '愿他用他的脸光照我们。', '42', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1315', '1027320', '1031340', '那神的同在，神的面对面能带来什么？', '42', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1316', '1031360', '1038800', '能带来光照，这个光照呢就是在生活当中的引导，在生活当中的代理。', '42', '0', '20', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1317', '1039080', '1042470', '有了神的同在，就有神的光照，', '42', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1318', '1042480', '1049720', '有了什么同在进入时呢引导，最后谁的代理就有什么力量，就有什么保护。', '42', '0', '23', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1319', '1049740', '1055400', '所以我们说神的同在是解决所有问题的关键。', '42', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1320', '1056060', '1062290', '曾经有弟兄姐妹问过一个问题，可能也是我们有一些弟兄姐妹的问题。', '42', '0', '20', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1321', '1062410', '1067930', '他说他也有每一天的读经祷告以及礼拜天的聚会，', '42', '0', '17', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1322', '1068040', '1071580', '但是心里面呢还是非常的苦干，', '42', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1323', '1071660', '1074720', '与主的关系呢还是很疏远。', '42', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1324', '1074960', '1077390', '这个问题出在哪里呢？', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1325', '1078350', '1088900', '这个问题就出在虽然每一天有读经有祷告，每一周有聚会，但是在读经中在祷告中，在聚会中并没有遇见神，', '42', '0', '38', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1326', '1089240', '1091000', '这才是关键。', '42', '0', '5', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1327', '1091710', '1094130', '所以它里面还是苦干的，', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1328', '1094160', '1098360', '整个属灵的生命还是软弱的，还是无力的。', '42', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1329', '1099310', '1104090', '我们有没有遇点神，其实我们心里是清楚的。', '42', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1330', '1104860', '1110110', '那有时候我们说我不知道我有没有遇见，不知道有没有遇见，就是没遇见。', '42', '0', '20', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1331', '1110120', '1113240', '因为若是遇见了就一定是知道的，', '42', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1332', '1113680', '1116940', '甚至说你若尝过主恩的滋味，', '42', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1333', '1116950', '1121750', '便知道他是何等的美善，遇见神，我们一定是知道，', '42', '0', '17', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1334', '1121760', '1124510', '不知道有没有遇见，那就是没遇见。', '42', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1335', '1126140', '1133960', '所以圣经告诉我们说，神同在是我们解决生活当中所有问题的一个关键，', '42', '0', '20', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1336', '1134490', '1137310', '生存在不是一劳永逸的事情。', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1337', '1137320', '1142480', '不是，我今天有点神了，我自然而然在明天也能预见是', '42', '0', '16', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1338', '1142760', '1145750', '遇见神应该是每一天的追求，', '42', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1339', '1145850', '1148060', '是每一天的渴慕。', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1340', '1148370', '1159330', '今天遇见不代表明天仍然能够遇见，我们需要不断地接近自己，预备自己，对它有一个极大的渴慕，才能保守与他的关系。', '42', '0', '34', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1341', '1161530', '1170660', '今天CD来到以后，呢圣徒的生活的处境也改变了，首先就讲到说神要擦去我们一切的眼泪。', '42', '0', '29', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1342', '1171150', '1175480', '为什么说是要擦去我们的眼泪？呢因为这个社会', '42', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1343', '1175630', '1178890', '我们现实的生活有很多的痛苦，', '42', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1344', '1179270', '1184040', '所以我们讲到一个人的一生的时候，有一个简单的概括，', '42', '0', '17', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1345', '1185190', '1189990', '一个人的一生在自己的眼泪当中来到这个世界，', '42', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1346', '1190430', '1192950', '小孩一出生就是哭，对不对？', '42', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1347', '1193270', '1196790', '然后呢在别人的哭声当中', '42', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1348', '1196840', '1198230', '离开这个世界。', '42', '0', '5', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1349', '1199270', '1202560', '所以人的一生啊是从眼泪开始，', '43', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1350', '1202760', '1205010', '也是从眼泪结束的。', '43', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1351', '1205220', '1208340', '人的一生总是有很多的痛苦，', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1352', '1209790', '1212610', '圣经并没有要帮我们解决', '43', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1353', '1212630', '1215010', '生活当中所有的痛苦。', '43', '0', '6', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1354', '1215030', '1218600', '当神为我们预备的有一个荣耀的未来，', '43', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1355', '1218740', '1221700', '时预备的有一个荣耀的盼望，', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1356', '1221720', '1225210', '甚至今天我们生活当中所遇到的苦难，', '43', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1357', '1225230', '1227100', '有神的许可，', '43', '0', '4', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1358', '1227200', '1232360', '或者说对我们的生命是一个重要的陶造的部分，', '43', '0', '15', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1359', '1232950', '1236350', '有来跟大家讲过一个真实的见证，', '43', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1360', '1236850', '1238830', '说在文革期间，', '43', '0', '5', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1361', '1238840', '1241340', '有一个中国老基督徒，', '43', '0', '6', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1362', '1241360', '1245700', '因着儿女在美国，他也就搬到美国去生活。', '43', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1363', '1245930', '1254710', '进进到美国到美国以后，呢在美国也参加聚会，但是他总是感觉到美国教会跟中国教会有不一样的地方，', '43', '0', '31', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1364', '1255150', '1260470', '什么地方不一样，他也说不清楚，后来他找到问题所在了，', '43', '0', '18', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1365', '1260780', '1266580', '他说在中国教会聚会的时候，啊每一次传道人都讲主的再来', '43', '0', '20', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1366', '1266790', '1268920', '都讲将来的盼望。', '43', '0', '6', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1367', '1269020', '1272940', '当时去美国以后，这美国将会不讲主再来，', '43', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1368', '1273140', '1276060', '这美国这会不讲将来的盼望，', '43', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1369', '1276580', '1279550', '他就觉得很纳闷，不知道为什么。', '43', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1370', '1279710', '1282410', '后来呢他找到了答案，', '43', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1371', '1282550', '1288590', '因为中国教会一直在苦难中一直在逼迫中，大家讲不讲未来，', '43', '0', '18', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1372', '1288600', '1290580', '大家讲不讲盼望，', '43', '0', '6', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1373', '1290590', '1293670', '都巴望着说，主耶稣你快来吧。', '43', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1374', '1294050', '1299400', '但是到美国以后呢没有逼迫，环境是自由的，', '43', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1375', '1299420', '1303900', '物质生活是丰富的，他们盼望主再来，嘛', '43', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1376', '1305240', '1309250', '他们也是怕忘，但是这个心就不强烈。', '43', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1377', '1309910', '1312960', '有一个弟兄我们关系非常好，', '43', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1378', '1314060', '1318090', '他年龄跟我差不多，啊去年前年才结婚，', '43', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1379', '1318330', '1321690', '所以应该是属于大龄晚婚的这种。', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1380', '1322430', '1325560', '他在结婚以前呢他常常有一个盼望，', '43', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1381', '1325870', '1329020', '世界赶紧毁灭，吧都毁灭算了。', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1382', '1329330', '1335330', '现在结完婚以后，呢它也不巴望着世界毁灭了，她对生活充满了向往。', '43', '0', '22', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1383', '1335480', '1337690', '所以人的处境的不同，', '43', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1384', '1337730', '1341470', '他对神的再来的他们的程度就是不同了。', '43', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1385', '1342210', '1350890', '所以我们生活在这个世界上，弟兄姐妹的确会有很多的难处，如果没有难处的话，我们怎么会有属天的盼望呢？', '43', '0', '33', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1386', '1351140', '1359540', '所以苦难本身也是有价值的，可是当基督再来的时候，他就要彻底的擦干我们所有的眼泪，', '43', '0', '27', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1387', '1361110', '1371710', '所有的眼泪他都要擦干，她要带给我们安慰，在那个时候呢没有死亡，没有悲伤，没有哭嚎也没有疼痛，', '43', '0', '32', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1388', '1371730', '1373950', '这一些负面的情绪，', '43', '0', '6', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1389', '1373960', '1378690', '这些艰难的处境，神通通都把它挪去了。', '43', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1390', '1378750', '1381830', '那是我们最终得数的时候，', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1391', '1382730', '1388830', '不仅夺去我们所有的难处，并且让我们承受天上的经验。', '43', '0', '16', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1392', '1388850', '1393470', '所以对于基督徒来说，不仅有基督，我们还有积液。', '43', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1393', '1393620', '1398390', '我们喝到生命前的水，我们得着了儿子的名分，', '43', '0', '16', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1394', '1398400', '1402050', '以儿子的名分来承受基因。', '43', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1395', '1402400', '1406000', '我们不是故宫，不是打工的得工价，', '43', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1396', '1406090', '1409860', '而是以儿子的名分来承受产业。', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1397', '1411170', '1413200', '当然对于那些', '43', '0', '3', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1398', '1413580', '1418290', '没有依靠神到底的，就非常可悲，就落在审判当中。', '43', '0', '15', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1399', '1419220', '1430500', '讲到胆怯的，不信的可颂的杀人的淫乱，拜偶像，他们的份就在烧着硫磺的火湖当中，这个审判是一直到永远。', '43', '0', '37', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1400', '1431620', '1438660', '当我们讲到审审判这一切的人的时候，把哪一个人排在第一位，大家有留心吗？', '43', '0', '26', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1401', '1439420', '1446380', '在审审判的这些对象，或者说这些罪恶当中，把哪个排在第一位？', '43', '0', '19', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1402', '1447060', '1448120', '但切', '43', '0', '2', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1403', '1448480', '1450760', '把胆怯排在第一位，', '43', '0', '6', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1404', '1450850', '1453870', '为什么把胆怯的排在第一位呢？', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1405', '1455120', '1458830', '这跟约翰写作启示录的背景有关。', '43', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1406', '1458850', '1463130', '约翰岁起事故的时候就会处在一个怎样的状况底下？', '43', '0', '15', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1407', '1464120', '1466370', '手逼迫的状况底下。', '43', '0', '6', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1408', '1466550', '1469650', '啊所以当时很多圣徒被杀害，', '43', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1409', '1469700', '1472370', '有许多的脚会被冲散，', '43', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1410', '1473240', '1475990', '应该限制负很大的代价。', '43', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1411', '1476000', '1479730', '所以有很多人应该道歉就离开信仰。', '43', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1412', '1480050', '1488340', '所以神在这里给出一个警告，当审判的时候，排在第一位的就是这一切胆怯的，', '43', '0', '24', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1413', '1488380', '1492680', '就是在信仰当中不能够一直坚持下来的。', '43', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1414', '1492690', '1495390', '这个神非常重要的提醒。', '43', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1415', '1496290', '1500600', '我常常跟刚跟弟兄姐妹分享说跟随主难不难？', '43', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1416', '1500900', '1502960', '十字架的路不容易，', '43', '0', '6', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1417', '1502970', '1504960', '但是不跟随主呢', '43', '0', '5', '2019-03-18 16:34:43', '更新的世界.m4a');
