INSERT INTO `text` VALUES ('1419', '1507320', '1509930', '跟随主的男友价值，', '43', '0', '6', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1420', '1510000', '1511860', '不跟随主的更难，', '43', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1421', '1511870', '1513060', '没有价值，', '43', '0', '3', '2019-03-18 16:34:43', '更新的世界.m4a');
