INSERT INTO `text` VALUES ('1423', '1515630', '1518560', '所以跟随主的人是需要勇气的，', '43', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1424', '1519950', '1524480', '当我们实践信仰的时候也是需要勇气的。', '43', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1425', '1525930', '1530720', '好，接下来我们就分享第二点，第二个内容，啊西药用骚了。', '43', '0', '21', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1426', '1530900', '1535560', '新天新地的核心就是锡业路撒冷。', '43', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1427', '1535700', '1539310', '新耶路撒冷被称为是基督的新妇，', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1428', '1539330', '1541600', '被称为是神的帐幕，', '43', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1429', '1541610', '1545700', '也被称为是圣徒的居所，', '43', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1430', '1545720', '1548080', '啊被称为圣徒的居所。', '43', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
