INSERT INTO `text` VALUES ('1432', '1555860', '1559590', '有12个门，每一个门上有12位天使，', '43', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1433', '1559600', '1561110', '应该是说', '43', '0', '3', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1434', '1561130', '1563790', '一个很神圣很庄严的地方，', '43', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1435', '1563890', '1567550', '然后呢每一个门上刻着12支派的名字。', '43', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1436', '1567680', '1576520', '当然这个12之派呢它所代表的不只是以色列人，就代表所有属神的人，因为12是一个完全数，', '43', '0', '30', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1437', '1576920', '1583170', '又有12根基12，根基上又写着12使徒的名字，', '43', '0', '16', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1438', '1583180', '1586130', '所以12个支派的名字再乘上', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1439', '1586230', '1589680', '12个使徒的名字也在呈上。', '43', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1440', '1591510', '1603620', '当讲到12使徒的时候，他的名字写在根基上，就应验了保罗所说的话，神的国是建立在使徒和先知的教训上面。', '43', '0', '38', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1441', '1604120', '1610740', '12是一个完全数代表圣城的完全完美无瑕。', '43', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1442', '1611490', '1617370', '然后呢又有天使拿一个经纬子当作尺子，就把成量一量。', '43', '0', '19', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1443', '1618970', '1621190', '这个量一量代表什么呢？', '43', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1444', '1621200', '1624490', '就代表神对整个城的保护，', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1445', '1624740', '1627800', '整个圣城在谁的遮盖当中？', '43', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1446', '1628410', '1632210', '这个城呢它的轮廓是一个正方体，长宽。', '43', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
