INSERT INTO `text` VALUES ('1453', '1649340', '1657130', '但是这个城呢不只是方的，啊它是一个正方体，长宽高都是4000米，', '43', '0', '21', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1454', '1657370', '1661620', '这让我们想到了圣殿当中的至圣所。', '43', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1455', '1662150', '1666560', '我们还记得至圣所嘛就是存放神的约柜的地方，', '43', '0', '16', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1456', '1666590', '1670140', '是会幕和圣殿最核心的部分。', '43', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
