INSERT INTO `text` VALUES ('1475', '1741300', '1747010', '这个12乘是不是我们的身高不是我们的腰围，它是一个象征性的，', '43', '0', '18', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1476', '1747020', '1750350', '就代表说我们是完全的。', '43', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1477', '1753040', '1758970', '第二个方面来讨论一下这个成的材质，它用什么材质来建造的。', '43', '0', '20', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1478', '1759010', '1764560', '今天的城市高楼大厦说这钢筋混凝土建造的。', '43', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1479', '1764570', '1768580', '那么圣城耶路撒冷是用什么材质建造的呢？', '43', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
