INSERT INTO `text` VALUES ('1484', '1780050', '1785770', '那是不是将来整个圣城耶路撒冷就是这样的一个珠光宝气，呢', '43', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
