INSERT INTO `text` VALUES ('1487', '1793250', '1797430', '为了衬托神的荣耀与圣洁，', '43', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1488', '1797450', '1801840', '衬托信徒的尊贵和美好的品性。', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1489', '1802130', '1809550', '事实上讲到将来的圣城的时候，讲到将来的荣耀的时候，保罗曾经说过，', '43', '0', '21', '2019-03-18 16:34:43', '更新的世界.m4a');
