INSERT INTO `text` VALUES ('1491', '1812400', '1814680', '人的耳朵没有听过，', '43', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1492', '1814700', '1818090', '是人的心想都想不到的，', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1493', '1818110', '1821600', '绝对不是金银宝石可以衡量的。', '43', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1494', '1821700', '1829950', '但是约翰它只能用最好的东西去描述，事实上要比这个更好千倍百倍。', '43', '0', '20', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1495', '1831900', '1835440', '然后乘的根基呢是12样宝石。', '43', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1496', '1835460', '1844320', '这12样宝石呢11旧约设计当中，大祭司的胸前有12国宝石为背景的，', '43', '0', '21', '2019-03-18 16:34:43', '更新的世界.m4a');
