INSERT INTO `text` VALUES ('1498', '1846620', '1848330', '穿着圣袍，', '43', '0', '4', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1499', '1848340', '1853810', '外面再套上一副得你负责的，前面有12个袋子都在show前，', '43', '0', '21', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1500', '1853820', '1858920', '每一个袋子里面装一块宝石，就带着以色列12支派，', '43', '0', '15', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1501', '1860880', '1869500', '所以成的根基是12种宝石，是以大菲斯胸前的12活宝石为背景的为基础的。', '43', '0', '26', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1502', '1869510', '1877180', '就是表示说神所有的救赎在新耶路撒冷的里面就完全的成就了。', '43', '0', '18', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1503', '1878290', '1893740', '大气司胸前的12本胸牌代表以色列12个支派代表着他，为所有的属神的百姓来祝福，来守望来祷告，在基督再来的时候就完全实现了。', '43', '0', '43', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1504', '1894230', '1897320', '对于我们来说，我们是不是祭司，呢', '43', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
