INSERT INTO `text` VALUES ('1508', '1910650', '1915020', '也许我们说买不起宝石，啊没有那么多宝石挂在生前，', '43', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1509', '1915320', '1919860', '这12个宝石就代表着说，我们对神的子民的唉', '43', '0', '16', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1510', '1919870', '1924300', '对神的子民的责任和对使得子民的付出，', '43', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1511', '1924320', '1929030', '当然也包括用基督的方式对待我们的家人，', '43', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
