INSERT INTO `text` VALUES ('1515', '1943220', '1951820', '那个时候在上城里面不需要再建造一个圣殿，不需要再建一个教会，这个城本身就已经是神的圣殿了。', '43', '0', '31', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1516', '1951840', '1957130', '因为城市四方的是正方体，正如至圣所是一样的。', '43', '0', '16', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1517', '1958050', '1960920', '那个时候呢我们行在光中，', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1518', '1961820', '1963400', '神就是光，', '43', '0', '4', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1519', '1963490', '1969330', '主就是登那个时候呢不需要任何的这种照明设备。', '43', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1520', '1969620', '1976520', '不是，是不只是所有的灯光不需要了，连日光月光和星光都不需要了。', '43', '0', '22', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1521', '1977130', '1980600', '在雅歌书里面时被称为什么？', '43', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1522', '1980850', '1982950', '众光之父，啊', '43', '0', '6', '2019-03-18 16:34:43', '更新的世界.m4a');
