INSERT INTO `text` VALUES ('1529', '2024110', '2029300', '并且讲到说城门白昼，总部关闭，那晚上关不关，呢', '43', '0', '17', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1530', '2030420', '2032550', '白天总部关闭，', '43', '0', '4', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1531', '2032590', '2035270', '晚上关不关，呢没有晚上，', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
