INSERT INTO `text` VALUES ('1546', '2096760', '2103700', '一造争光，宇宙明儿造空气柱天青，就在这七天当中，哪一天最重要的？', '43', '0', '26', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1547', '2105870', '2107980', '一般认为是第六天。', '43', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1548', '2108000', '2112250', '因为世人对创造知识创造了高潮。', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
