INSERT INTO `text` VALUES ('1559', '2148600', '2155640', '所以神对我们拯救到最后的时候，一定让我们进入到那种完全的自由平安', '43', '0', '20', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1560', '2155660', '2157640', '与安息当中。', '43', '0', '4', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1561', '2158030', '2162360', '正如这里所讲的，圣城的门是不需要关闭的。', '43', '0', '15', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1562', '2163150', '2167590', '最后我们的结论呢是本章当中的一节经文，', '43', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1563', '2167600', '2170090', '是我们大家共同的勉励。', '43', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1564', '2171170', '2175240', '我们一起来读这节经文启示录20章第七节。', '43', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1565', '2175260', '2183810', '得胜的必承受，这些为业，我要做他的神，他要做我的儿子。', '43', '0', '23', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1566', '2184800', '2187830', '那谁所预备的好不好呢？', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1567', '2188170', '2196790', '是非常好的。刚才我们看到了新天新地看到了新耶路撒冷，但是要想承受这一切，有一个条件，', '43', '0', '29', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1568', '2197120', '2198750', '我们要得胜。', '43', '0', '4', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1569', '2200080', '2206870', '这个得事就代表说，在千难万苦当中依然持守信仰前行。', '43', '0', '19', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1570', '2207020', '2213620', '这叫做得胜是最基本的，得胜的人要承受这些为业。', '43', '0', '17', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1571', '2215020', '2216980', '啊这个天上的基业，', '43', '0', '6', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1572', '2216990', '2221200', '把地上所有的财富加起来，也不能与他相比。', '43', '0', '14', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1573', '2222380', '2226990', '这第一个关键这一节经文的第一个关键就是得胜。', '43', '0', '15', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1574', '2227130', '2230280', '那第二个关键就是关系。', '43', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1575', '2230610', '2238490', '谁要做我们的神，我们要做他的儿子，这强调的是我们跟神的关系。', '43', '0', '24', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1576', '2239000', '2247850', '在我们所有的日常生活当中，教会生活当中最重要的一个部分，就是跟神的关系是怎么样的。', '43', '0', '26', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1577', '2248250', '2251740', '有一句话说我不讲到，有人讲到，', '43', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1578', '2252300', '2254720', '我不唱诗，有人唱诗，', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1579', '2254730', '2257780', '所以我的工作是可以由别人来代替的。', '43', '0', '12', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1580', '2257790', '2261050', '但是有一样东西是别人代替不了的，', '43', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1581', '2261060', '2263310', '这是我们跟神的关系。', '43', '0', '8', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1582', '2263740', '2269250', '弟兄姐妹无论读经也好，祷告也好，服饰也好，奉献也好，这都很重要。', '43', '0', '21', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1583', '2269260', '2271590', '但比这些更重要的是', '43', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1584', '2271600', '2277910', '是我们跟神的关系到底是怎么样的，这个才是最重要的。', '43', '0', '18', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1585', '2279070', '2283990', '愿主开我们的眼，让我们看到将来那荣耀的盼望，', '43', '0', '16', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1586', '2284880', '2291220', '也愿神加给我们力量，是我们每一天都保守与他亲密的关系。', '43', '0', '21', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1587', '2291280', '2296380', '与神有了关系，我们做其他事情是事半功倍的。', '43', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1588', '2296430', '2302430', '于是没有关系，我们做其他事只是是事倍功半的，', '43', '0', '13', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1589', '2302690', '2304500', '啊这是不一样的。', '43', '0', '7', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1590', '2304510', '2308490', '好，乐臣伺候大家，我们早上信息就分享到这里。', '43', '0', '15', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1591', '2308660', '2319570', '啊以下有两个报告，第一个报告就是说前两个主日，我们大家奉献了一批旧衣服，啊我们准备捐到云南山区少数民族那里，', '43', '0', '36', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1592', '2319590', '2326440', '把我们不需要的东西，或者说我们额外付出的一个部分成为他们的帮助。', '43', '0', '20', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1593', '2327240', '2338120', '但是截止到这个主任，我们大家就不需要再往把这个衣服拿到交互里面来了，我们这一次捐献旧衣服的活动到今天就告一段落了。', '43', '0', '36', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1594', '2338140', '2342970', '啊教会也不是每一个主日都要来收集这些就医负担。', '43', '0', '16', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1595', '2343650', '2351190', '第二个报告就是应该说是一个见证，嘛一个感恩的分析啊神，保守我妻子平安顺利的生产。', '43', '0', '26', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1596', '2351290', '2354620', '啊就是3月12号就是', '43', '0', '4', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1597', '2354720', '2356650', '上礼拜二那天', '43', '0', '5', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1598', '2356810', '2361360', '啊平安顺利的生产，然后母子平安，也很感谢谁。', '43', '0', '15', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1599', '2361380', '2367540', '啊今天也预备了一些啊糖块和瓜子，分享这一个感恩的见证。', '43', '0', '19', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1600', '2367550', '2370410', '那最后想请常姨来做一个', '43', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1601', '2370430', '2377070', '啊祝福祷告，我们就可以分享一点这个糖果和瓜子，我们聚会就结束。', '43', '0', '19', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1602', '2377140', '2380410', '茶怡，你来做个结束祷告。', '43', '0', '11', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1603', '2381280', '2382650', '啊', '44', '0', '1', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1604', '2389000', '2390940', '移动。', '44', '0', '3', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1605', '2390950', '2393040', '这个我倒是就希望你这么高！', '45', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1606', '2396760', '2399150', '请啊也是我们感谢您！', '46', '0', '9', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1607', '2399150', '2400210', '谢谢你！', '47', '0', '4', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1608', '2400210', '2426550', '在你的带领保守下已经是能够是临界平安生产，这一切终要归给我们天上的神助，也也恳求恳求朱也也也就听了我们众弟兄什么的斗狗这真是胜利大的面，这个家庭他们一生这样的全家释放你爱你全心的奉献，只求你在', '48', '0', '69', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1609', '2426560', '2450790', '天上纪念在地上大大的祝福他们他们的爱心说说现在禁物主要求你要祝福他们，使他们无处可容，叫每个弟兄姊妹分享的时间成一个感恩的心来领受我们谢谢耶稣，就够垂听孩子我们的斗狗祷告，祈求奉耶稣这个名丘。', '48', '0', '65', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1610', '2450800', '2453960', '好，我们一同起立主祷文！', '48', '0', '10', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1611', '2456900', '2458600', '耶稣教导我们说，', '49', '0', '5', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1612', '2458610', '2485880', '门在天上的父愿人都经历了议会上院一的国降临，远远是隐行在地上，如同行在天上，我们就在饮食，今日赐给我们练我们的债，如同我们免人的在不叫我们遇见，试探救我们，脱离胸和，因为国度权柄，荣耀全是你的，直到永远，啊', '49', '0', '76', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1613', '2485890', '2486940', '妹。', '49', '0', '3', '2019-03-18 16:34:43', '更新的世界.m4a');
INSERT INTO `text` VALUES ('1614', '2486950', '2489870', '啊愿神赐后，大家那就在后面放，大家可以。', '50', '0', '17', '2019-03-18 16:34:43', '更新的世界.m4a');
