INSERT INTO `text` VALUES ('1639', '13710', '15520', '姊妹精心设计的图片，', '2', '0', '6', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1640', '16160', '18540', '让人看上去很有食欲，', '2', '0', '7', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1641', '18550', '20270', '也让人印象深刻。', '2', '0', '7', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1642', '20520', '21690', '今天我给大家介绍，', '3', '0', '6', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1643', '21700', '23800', '的不是这个世界上的食物！', '3', '0', '9', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1644', '23810', '25580', '不是那种仅仅让我们的。', '4', '0', '8', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1645', '25590', '27310', '身体得到饱足的食物，', '5', '0', '7', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1646', '27320', '28790', '而是属灵的食物。', '5', '0', '6', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1647', '28830', '30160', '实际上说人。', '5', '0', '5', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1648', '30170', '31070', '活着不是单靠。', '6', '0', '6', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1649', '31080', '32280', '食物乃是靠神！', '7', '0', '6', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1650', '32290', '33970', '口里所出的一切话，', '8', '0', '8', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1651', '33980', '37850', '我们的身体每天都需要供应我们的零也是这样。', '8', '0', '14', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1652', '37910', '42340', '但是很可惜我们铃铃的状态常常是贫乏的，', '8', '0', '13', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1653', '42490', '45330', '经常还只是停留在温饱线上，', '8', '0', '9', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1654', '46370', '53210', '每周一餐这样的主日聚会，还不能供应我们整个人各方面的灵里的需要。', '8', '0', '22', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1655', '53250', '57760', '所以当我们仅仅是经历到一些常人都会经历的患难之时，', '8', '0', '16', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1656', '57770', '60630', '我们就会感到林里面极其的匮乏。', '8', '0', '10', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1657', '60730', '66810', '当我们想要给身边的人一些凌云的帮助时，才发现自己里面其实也是空的。', '8', '0', '24', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1658', '66990', '70290', '诞生把一个很好的传飞的机会摆在我面前的。', '8', '0', '14', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1659', '70300', '73080', '时候，我们有望会把它错失掉！', '8', '0', '11', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1660', '73670', '81130', '我们每一天都需要有足够的灵力的供应，才能够让我们也成为一个丰盛的人。', '9', '0', '25', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1661', '81710', '83940', '现在我也给大家介绍一下这。', '9', '0', '10', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1662', '83950', '85050', '份美味的食物！', '10', '0', '6', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1663', '85060', '86550', '每日灵粮。', '11', '0', '4', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1664', '87110', '88500', '请看图片。', '11', '0', '4', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1665', '88540', '91510', '这是一个美味的鸡肉汉堡模型，', '11', '0', '9', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1666', '91520', '93200', '上下两片面包，', '11', '0', '5', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1667', '93210', '95930', '中间一个外交理论的鸡块，', '11', '0', '7', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1668', '95940', '98650', '上面还有几片新新的蔬菜和沙拉。', '11', '0', '11', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1669', '98950', '109490', '对于每日灵粮的话，上下两片面包就分别代表着灵修开始前安静心灵的祷告和灵秀结束后感恩回应的祷告。', '11', '0', '31', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1670', '109650', '114260', '中间的主角肌肉块可以理解为圣经上神的话语，', '11', '0', '14', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1671', '114280', '118530', '读经相当于咬下鸡肉块外面焦脆的壳，', '11', '0', '14', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1672', '118660', '121070', '但是有经验的人都知道，', '12', '0', '8', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1673', '121080', '122780', '这个时候还没有吃到肉！', '12', '0', '8', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1674', '122800', '125890', '这个脆壳只是肉外面裹的一层面而已。', '13', '0', '12', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1675', '126040', '128300', '严禁和没想才是咬透了。', '13', '0', '11', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1676', '128310', '129360', '外壳之后，这到了。', '14', '0', '7', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1677', '129370', '131260', '鲜嫩多汁的鸡肉，', '15', '0', '6', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1678', '131510', '133870', '几片新鲜的蔬菜和西红柿，', '15', '0', '8', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1679', '133930', '138700', '可以理解为我们的唱诗，赞美我们感性上与神的相交。', '15', '0', '17', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1680', '139130', '146000', '如果再丰富一些配乐伴奏节拍和宣告的话，就相当于加了沙拉酱和其他的配料。', '15', '0', '22', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1681', '146140', '150970', '这样的话，一个完整的味道鲜美营养均衡的属灵汉堡早餐', '15', '0', '16', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1682', '150990', '152100', '就成了。', '15', '0', '4', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1683', '152840', '155130', '有人说这样吃热比较干！', '16', '0', '9', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1684', '155140', '157460', '要是再来一杯牛奶就好了，', '17', '0', '10', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1685', '157540', '159640', '那可以代表着圣灵的浇灌。', '17', '0', '8', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1686', '159660', '164630', '有了圣灵的参与属灵，早餐就更加容易下咽舒畅。', '17', '0', '14', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1687', '164650', '168730', '当然只要我们愿意，我们还可以加入更多美好的事物进来。', '17', '0', '16', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1688', '169400', '171270', '这里需要特别说一下，', '18', '0', '6', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1689', '171280', '172550', '祷告是我们。', '18', '0', '5', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1690', '172560', '174150', '向主再说话，', '19', '0', '5', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1691', '174160', '177090', '读音是我们的主，向我们说话。', '19', '0', '10', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1692', '177100', '182840', '严谨和默想，就是我们想办法把神的话放在我们的心里面，', '19', '0', '19', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1693', '182860', '186620', '尝试和赞美是我们在感性上与身的交通，', '19', '0', '13', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1694', '186640', '187150', '每一个。', '19', '0', '4', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1695', '187160', '188970', '部分都是非常重要的。', '20', '0', '6', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1696', '189180', '190420', '我们如果单单。', '20', '0', '5', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1697', '190430', '196890', '重视集中到某一个方面，或者忽略了任何一个方面，都会造成我们属灵的营养不良。', '21', '0', '23', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1698', '197400', '199960', '连续的核心部分是圣经的经文。', '21', '0', '9', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1699', '199980', '203590', '在图片的最上面推荐了有12卷书，', '21', '0', '12', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1700', '203820', '206010', '从左到右分别是。', '21', '0', '8', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1701', '206210', '208240', '约翰福音罗马书，', '22', '0', '4', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1702', '208260', '211850', '有所书约翰123，舒雅各书。', '22', '0', '11', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1703', '211910', '216570', '马太福音使徒行传，创世纪，出埃及记和诗篇。', '23', '0', '13', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1704', '216580', '221590', '这都是比较容易读的，经文，涵盖的内容也相对全面一些。', '23', '0', '17', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1705', '222190', '226530', '每次灵修的时候经文比较多，每天读十节左右就可以了。', '23', '0', '17', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1706', '226540', '227790', '多读几遍。', '23', '0', '5', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1707', '227900', '231220', '这样的话20分钟的时间是够用的。', '23', '0', '11', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1708', '231980', '236100', '这个方式比较适合于还没有稳固零由习惯的地方姐妹。', '23', '0', '15', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1709', '236120', '239620', '如果你已经有了比较稳固的灵修，并且也比较满意，', '23', '0', '14', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1710', '239640', '242190', '那么就可以在你现有的基础上', '23', '0', '9', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1711', '242210', '247130', '调整一下结构式祷告，经文和诗歌的比例均衡一些，', '23', '0', '14', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1712', '247150', '251960', '使我们的灵里面的供应不至于出现营养的缺失就可以了。', '23', '0', '16', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1713', '252230', '254400', '再一个就是时间的问题，', '23', '0', '7', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1714', '254430', '260620', '如果能把零星的时间放在早上是最好的，实在不行可以考虑放在其他的时间。', '23', '0', '21', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1715', '260890', '264360', '每天尽量是固定的时间固定的地方。', '23', '0', '10', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1716', '264370', '267370', '预备好圣经，诗歌本笔记本。', '23', '0', '8', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1717', '267690', '272690', '如果不行，也可以考虑用一些零散的时间，比如陆上交通的时间，', '23', '0', '18', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1718', '272710', '274100', '等待的时间，', '23', '0', '4', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1719', '274370', '277160', '总而言之有比没有要好，', '23', '0', '6', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1720', '277170', '279940', '有固定的时间比零散的时间要好，', '23', '0', '11', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1721', '279950', '283130', '放在早上比放在其他的时间要好。', '23', '0', '11', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1722', '283780', '285040', '刚开始的时候，', '24', '0', '5', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1723', '285050', '289290', '或许也会有失败，但是请不要灰心，一定要鼓起勇气。', '24', '0', '17', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1724', '289310', '295820', '哪一天失败了，就从那一天重新开始做起来，务必尽早培养天天灵修的好习惯。', '24', '0', '25', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1725', '296040', '300980', '最后，愿主耶稣基督，还有我们的父神赐福于大家，', '24', '0', '16', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1726', '300990', '305070', '使我们都能够称为生命丰盛，能靠着圣灵的帮助，', '24', '0', '16', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1727', '305070', '307170', '或出影响力的基督的门徒。', '25', '0', '8', '2019-03-21 14:34:51', 'E:/2.lfasr/201903201819$2858.mp3');
INSERT INTO `text` VALUES ('1728', '0', '2180', '科大讯飞是中国最大！', '0', '0', '7', '2019-03-22 00:08:32', 'E:/2.lfasr/201903220007_75.wav');
INSERT INTO `text` VALUES ('1729', '2190', '3080', '的智能。', '1', '0', '4', '2019-03-22 00:08:32', 'E:/2.lfasr/201903220007_75.wav');
INSERT INTO `text` VALUES ('1730', '3090', '4950', '语音技术提供商，', '2', '0', '4', '2019-03-22 00:08:32', 'E:/2.lfasr/201903220007_75.wav');
